var book = {
	"name": "Josue",
	"numChapters": 24,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> Ket naaramid iti calpasan ti ipapatay ni Moises nga adipen ni Jehova, a ni Jehova nagsao ken ni Josue nga anac ni Nun, a catulongan ni Moises, a kinunana,",
			"2": "<sup>2</sup> Ni Moises nga adipenco natayen: tumacderca ngarud ita, ket ballasiwem daytoy Jordan, sica ken isu-amin daytoy nga umili, iti daga isu nga itedco cadacuada, cadagiti met laeng annac ti Israel.",
			"3": "<sup>3</sup> Ti tumunggal disso a ti dapan ti sacam baddekennanto, dayta itedconto cadacayo, a cas insaoc idi ken ni Moises.",
			"4": "<sup>4</sup> Manipud iti let-ang ken iti daytoy Libano agingga iti dackel a carayan, ti carayan nga Eufrates, isu-amin a daga dagiti Jetteos, ken aginggana iti dackel a taaw iti agpalelennecan ti init, isunto ti beddengyo.",
			"5": "<sup>5</sup> Awan ti siasinoman a tao a macagawayto kenca cadagiti isu-amin nga al-aldaw ti panagbiagmo: cas iti caaddac idi ken ni Moises casta met ticaaddacto kenca; dicanto baybay-an ken dicanto met panawan.",
			"6": "<sup>6</sup> Bumilegca ket umingelca; ta sicanto ti mamagtawid cadagitoy a tattao iti daga nga insapatac cadagiti ammada nga itedco cadacuada.",
			"7": "<sup>7</sup> Isuna laeng a bumilegca ken umingelca unay, tapno tungpalem nga aramiden iti cas mayalubog iti isu-amin a linteg, a ni Moises nga adipenco imbilinna kenca: saanmo a pagpanawan uray iti macanawan uray iti macatigid, tapno agbanagcanto a sisasayaat iti sadinoman a papanam.",
			"8": "<sup>8</sup> Daytoy a libro ti linteg dinto umadayo ita ngiwatmo: no di ket iti aldaw ken iti rabii panpanunotemto, tapno tungpalem nga aramiden ti cas mayalubog iti isua-min nga adda a naisurat kencuana: ta iti casta parang-ayemto ti dalanmo ket iti casta addanto naimbag a banagmo.",
			"9": "<sup>9</sup> Saanco aya nga imbilin kenca? Bumilegca, ket umingelca: saanca nga agbuteng ket dica met agcullayaw: ta ni Jehova a Diosmo adda kenca iti sadinoman a papanam.",
			"10": "<sup>10</sup> Idin ni Josue binilinna dagiti turturayen ti ili, a kinunana,",
			"11": "<sup>11</sup> Magnacayo ket lasatenyo daytoy a pacarso ket ibilinyo cadagiti tattao, a cunayo, Mangsaganacayo iti taraon: ta iti uneg ti tallo nga al-aldaw bumallasiwcayto itoy Jordan tapno sumreccayo nga agtagicua iti daga, a ni Jehova a Diosyo itedna cadacayo, tapno isu ti tagicuaenyo.",
			"12": "<sup>12</sup> Ket ni Josue nagsao cadagiti Rubenitas, ken cadagiti Gaditas, ken iti caguddua ti caputotan ni Manases, a kinunana,",
			"13": "<sup>13</sup> Lagipenyo ti sao nga imbilin ni Moises, nga adipen ni Jehova cadacayo, a kinunana, Ni Jehova a Diosyo iniccannacayo iti inana, ket itednanto daytoy a daga.",
			"14": "<sup>14</sup> Dagiti assawayo, annacyo ken dagiti an-animalyo agyandanto iti daga a ni Moises intedna cadacayo iti ballasiw ti Jordan; ngem bumallasiwcayto a siiigam, amin dagiti lallaki a napigsa ken maingel iti masangoanan dagiti cacabsatyo, ket tulonganyonto ida:",
			"15": "<sup>15</sup> Inggana iti ni Jehova maitednan iti inana cadagiti cacabsatyo, a cas iti pannangtedna cadacayo, ket isuda tagicuaendanto met ti daga a ni Jehova a Diosyo itedna cadacuada: ket iti casta agsublicayton iti daga a pagtagicuaanyo, ket isu ti tagicuaenyo, isu a ni Moises nga adipen ni Jehova intedna cadacayo iti ballasiw ti Jordan nga agturong iti leleggacan ti init.",
			"16": "<sup>16</sup> Ket idin simmungbatda ken ni Josue, a kinunada, Amin nga imbilinmo cadacami aramidenminto, ket mapancamto iti uray sadino a pangibaonam cadacami.",
			"17": "<sup>17</sup> Cas iti panangipangagmi idi ken ni Moises cadagiti isu-amin a banbanag, casta met ti panangipangagminto kenca: ni Jehova a Diosmo adda coma laeng kenca a cas iti kinaaddana idi ken ni Moises.",
			"18": "<sup>18</sup> Uray siasino a sumalungasingto iti bilinmo, ket saan a dumngegto cadagiti sasaom iti amin nga ibilinmonto kencuana, mapapatayto; isuna laeng a bumilegca ken umingelca."
		},
		"2": {
			"1": "<sup>1</sup> Ket ni Josue nga anac ni Nun imbaonna manipud Settim dagiti dua nga agsiim iti nalimed unay, a kinunana cadacuada, Incayo, imatanganyo ti daga, ken ti Jerico. Isuda napanda, ket simrecda iti balay ti maysa a babai a balangcantis a managan Raab, ket nagdagusda sadiay.",
			"2": "<sup>2</sup> Ket naidamag idi iti ari ti Jerico, a nacuna, Adtoy, ita a rabii dagiti tattao cadagiti annac ti Israel immayda ditoy a mangsiim iti daga.",
			"3": "<sup>3</sup> Ket idin ti ari ti Jerico nagbaon ken ni Raab, a kinunana, Iruarmo dagiti tattao nga immay kenca, ket simrecda iti balaymo; ta immayda a mangsiim iti isu-amin a daga.",
			"4": "<sup>4</sup> Ngem di babai innalana dagidi dua a tattao, ket inlemmengna ida; ket kinunana, Wen, dagiti tattao immayda caniac: ngem saanco a naammoan no taga anoda.",
			"5": "<sup>5</sup> Ket naaramid a idi umadani ti pannacairikep ti ruangan, idi nasipngeten, dagidi a tattao rimmuarda; ket diac ammo no sadino ti napananda; surutenyo ida iti madaras, ta abutenyo ida.",
			"6": "<sup>6</sup> Ngem isu pinaulina ida iti pangatepan, ket inlemmengna ida cadagiti puon ti lino nga inurnosna iti rabaw ti pangatepan.",
			"7": "<sup>7</sup> Ket dagiti tattao kinamatda ida iti dalan nga agturong iti Jordan agingga cadagiti pagballasiwan: ket apaman a dagidiay nagcamat cadacuada nacaruarda, rinpcanda di ruangan.",
			"8": "<sup>8</sup> Ket idi dida pay nagidda, isu immuli a napan cadacuada iti rabaw ti pangatepan;",
			"9": "<sup>9</sup> Ket kinunana cadagiti tattao, siac ammoc a ni Jehova intedna cadacayo daytoy a daga, ket dacami mabutengcami a gapu cadacayo: ket dagiti amin nga agnaed iti daga agrunawda iti sangoyo.",
			"10": "<sup>10</sup> Ta nangngegmi a ni Jehova pinagmagana dagiti danum ti Baybay a Nalabaga iti sangoananyo, idi a rimmuarcayo sadi Egipto; ken daydi inaramidyo cadagiti dua nga ar-ari dagiti Amorreos, a nagyanda idi iti ballasiw ti Jordan, da Seon ken Og, isuda a pinapatayyo a tinalipupus.",
			"11": "<sup>11</sup> Idinto a nangegmi daydi nagrunaw ti pusomi, awanen ti natda nga ingel iti uray maysa, a gapu cadacaya. Ta ni Jehova a Diosyo, isu ti Dios idiay ngato sadi langit, ken iti baba ditoy daga.",
			"12": "<sup>12</sup> Agdawatac ngarud cadacayo itatta, a pagsapataandac gapu ken ni Jehova, nga cas iti panangngaasic cadacayo, casta met ti aramidenyo iti balay ni amac, ket iccandac iti napudno a tanda;",
			"13": "<sup>13</sup> Ket biagenyonto ni amac ken ni inac, ken dagiti cacabsatco a lallaki ken babbai, ken amin daydiay a cucuada, ket ispalenyonto dagiti bibiagmi iti patay.",
			"14": "<sup>14</sup> Ket dagiti tattao kinunada kencuana, Ti biagmi maipaay iti biagmo, no dicay ipalgac coma daytoy a panggepmi; ket isunto, nga intono ni Jehova itedna cadacami daytoy a daga, agaramidcaminto kenca a sicacaasi ken sipupudno.",
			"15": "<sup>15</sup> Idin isu pinaulogna ida iti maysa a tali iti tawa: ta ti balayna adda idi iti rabaw ti bacud; ket isu nagtaeng idi iti rabaw ti bacud.",
			"16": "<sup>16</sup> Ket kinunana cadacuada, Incayo iti bantay: di la ket ta dagiti cumamat, matumpungandacayo: ket agyancayo idiay a silelemmeng iti tallo nga al-aldaw, inggana a dagidiay nga agcamat cadacayo, agawidda, ket iti calpasanna incayo iti dalanyo.",
			"17": "<sup>17</sup> Ket dagiti lallaki kinunada kencuana, Dacami dicamto mapabasol iti daytoy a sapatam isu a pinaisapatam cadacami.",
			"18": "<sup>18</sup> Kitaem ta intono sumreccami iti daga, sica igalutmonto daytoy a tali a nalabaga iti tawa isu a nangyulogam cadacami, ket sica ummongemto iti balaymo ni amam ken ni inam, dagiti cacabsatmo ken amin a cabbalay ni amam.",
			"19": "<sup>19</sup> Ket isunto, a siasinoman a rumuar cadagiti ruruangan ti balaymo a mapan iti calzada, ti darana addanto iti rabaw ti olona, ket awanto ti basolmi: ket uray siasinoman a makinaedto kenca iti balaymo, ti darana adda iti rabaw ti olomi no adda ima a mangsagid kencuana.",
			"20": "<sup>20</sup> Ngem no sica ipalgacmonto daytoy a panggepmi, dacami ngarud dicamto mapabasol iti daytoy a sapatam isu a pinaisapatam cadacami.",
			"21": "<sup>21</sup> Isu simmungbat, Cas ti kinunayo, castan coma. Ket imbaonna ida, ket pimmanawda; ket ingalutna di tali a nalabaga iti tawa.",
			"22": "<sup>22</sup> Ket rimmuarda, ket nacagtengda iti bantay ket nagyanda idiay iti tallo nga aldaw, agingga iti nacaawiden dagiti nagcamat cadacuada; ket dagidi nagcamat, nagbirucda cadacuada cadagiti amin a daldalan, ngem dida nasaracan ida.",
			"23": "<sup>23</sup> Idin dagidi dua a tattao nagawidda, ket simmalogda iti bantay, ket bimmallasiwda, ket immayda ken ni Josue nga anac ni Nun; ket sinaritada amin dagiti napasamacda.",
			"24": "<sup>24</sup> Ket kinunada ken ni Josue, Pudno a ni Jehova inyawatna amin a daga cadagiti imatayo; ket maysa pay, amin dagiti agnaed iti daga agrunawda iti sangotayo."
		},
		"3": {
			"1": "<sup>1</sup> Ket ni Josue bimmangon a nasapa iti bigat; ket immalisda nanipud Settim, ket immayda aginggana iti Jordan, isu, ken amin dagiti annac ti Israel; ket nagyanda sadiay iti sacbay ti ibaballasiwda.",
			"2": "<sup>2</sup> Ket naaramid idi calpasan dagiti tallo nga al-aldaw, a dagiti agturturay naglasatda idi iti nagtengngaan ti pacarso;",
			"3": "<sup>3</sup> Ket nagbilinda cadagiti tattao, a cunada, Intono makitayo coma ti lacasa ti tulag ni Jehova a Diosyo, ken dagiti papadi a dagiti Levitas a sia-awit kencuana, dacayo pumanawcayto iti yanyo, ket sumurotcayo kencuana.",
			"4": "<sup>4</sup> Ngem addanto pagbaetan isu ken cadacayo a cas iti rucod ti dua ribu a casico: dicayto dumenna kencuana: tapno maammoanyo coma ti dalan isu nga papananyo: agsipud ta dacayo dicay pay la naglasatan idi daytoy a dalan.",
			"5": "<sup>5</sup> Ket ni Josue kinunana cadagiti tattao: Santificarenyo dagiti bagbagiyo, ta intono bigat ni Jehova agaramidto cadagiti datdatlag iti tengngayo.",
			"6": "<sup>6</sup> Ket ni Josue nagsao cadagiti papadi, a cunana, Alaenyo ti lacasa ti tulag, ket agballasiwcayo nga umununa ngem cadagiti tattao. Ket isuda innalada ti lacasa ti tulag, ket napanda idi una ti umili.",
			"7": "<sup>7</sup> Ket ni Jehova kinunana ken ni Josue, Ita nga aldaw rugiancanto nga itan-oc iti imatang ti amin nga Israel, tapno maammoanda coma, a  cas ti caaddac idi ken ni Moises, castanto ti caaddac kenca.",
			"8": "<sup>8</sup> Ket ibilinmonto cadagiti papadi a mangawit iti lacasa ti tulag, a cunaem, Intono macaaycayo iti igid dagiti dandanum ti Jordan, agtacdercayto a sitatalna iti Jordan.",
			"9": "<sup>9</sup> Ket ni Josue kinunana cadagiti annac ti Israel, Umaycayo ditoy, ket imdenganyo dagiti sasao ni Jehova a Diosyo.",
			"10": "<sup>10</sup> Ket ni Josue kinunana, Ditoy maammoanyonto a ti Dios a sibibiag adda iti nagtengngaanyo, ket isu pacsiatennanto a di bumurong iti sangoyo ti Cananeo, ken ti Heteo, ken ti Heveo, ken ti Perezeo, ken ti Gergeseo, ken ti Amorreo, ken ti Jebuseo.",
			"11": "<sup>11</sup> Adtoy, ti lacasa ti tulag ti Apo iti isu-amin a lubong agballasiw iti Jordan iti sangoananyo.",
			"12": "<sup>12</sup> Gapuna a mangalacayo iti sangapulo ket dua a tattao cadagiti capcaputotan ti Israel, iti tumunggal caputotan maysa a tao.",
			"13": "<sup>13</sup> Ket maaramidto, a intono dagiti dapdapan dagiti sacsaca dagiti papadi a mangawit iti lacasa ni Jehova nga Apo iti isu-amin a lubong, maisaaddanto cadagiti dandanum ti Jordan, a dagiti dandanum ti Jordan agbingaydanto, dagiti met laeng dandanum a sumalog manipud surong; ket agintecdanto iti sangcagabsuon.",
			"14": "<sup>14</sup> Ket naaramid nga idi a dagiti tattao pimmanawda nanipud cadagiti toltoldada, tapno agballasiwda iti Jordan, dagiti papadi a nagawit iti lacasa ti tulag addada iti sangoanan dagiti tattao;",
			"15": "<sup>15</sup> Ket idi a dagidi a nagawit idi lacasa simmalugda iti Jordan, ken dagiti sacsaca dagiti papadi a nagawit idi lacasa naitanebda idi igid ti danum (ta ti Jordan aglippias iti amin a tepteppangna iti amin a tiempo ti panagani,)",
			"16": "<sup>16</sup> A dagiti dandanum a sumalog idi nga aggapu iti surong nagsardengda; ket timmacderda ket nagpangatoda a maysa a gabsuon, iti adayu idiay Adam, nga ili nga adda iti abay ti Sartan; ket dagidiay a nagsalog a nagturong iti baybay ti Araba, iti Baybay ti Asin met laeng, naibusdan amin, ket dagiti tattao nagballasiwda idi iti batog ti Jerico.",
			"17": "<sup>17</sup> Ket dagiti papadi a nangawit idi lacasa ti tulag ni Jehova nagtacderda a siiintec iti daga a namaga iti tengnga ti Jordan; ket isu-amin nga Israel nagballasiwda iti daga a namaga, agingga iti amin ti nacion nalpasda a nagballasiw iti Jordan."
		},
		"4": {
			"1": "<sup>1</sup> Ket naaramid, nga idi nga amin ti nacion nalpasda a nagballasiw ti Jordan, a ni Jehova nagsao ken ni Josue, a kinunana,",
			"2": "<sup>2</sup> Mangalacayo iti sangapulo ket dua a tattao iti umili, iti tunggal caputotan maysa a tao,",
			"3": "<sup>3</sup> Ket ibilinyo cadacuada, a cunayo, Mangalacayo manipud iti tengnga ti Jordan, iti lugar a nagtacderan a siiintec dagiti sacsaca dagiti papadi, iti sangapulo ket dua a batbato, ket icuyogyo ida cadacayo ket idissoyo ida, iti pagdagusanyo isu a pagdagusanyonto itoy a rabii.",
			"4": "<sup>4</sup> Idin ni Josue inayabanna dagiti sangapulo ket dua a tattao nga insaganana cadagiti annac ti Israel, iti tunggal caputotan maysa a tao:",
			"5": "<sup>5</sup> Ket ni Josue kinunana cadacuada, Magnacayo iti sangoanan ti lacasa ni Jehova a Diosyo iti tengnga ti Jordan, ket tunggal tao cadacayo mangibaclay coma iti maysa a bato, a cas mayalubog iti bilang dagiti caputotan dagiti annac ti Israel;",
			"6": "<sup>6</sup> Tapno daytoy isu coma ti maysa a pagilasinan cadacayo, nga intono dagiti annacyo agsalsaludsudda iti mapasungad a tiempo, a cunaenda, Ania aya ti pangipapananyo cadagitoy a batbato?",
			"7": "<sup>7</sup> Iti casta cunayonto cadacuada, Agsipud ta dagiti dandanum ti Jordan nagbisngayda iti sangoanan ti lacasa ti tulag ni Jehova; idi naiballasiw idiay Jordan, dagiti dandanum ti Jordan nagbisngayda: ket dagitoy a batbato isudanto ti pacalaglagipan cadagiti annac ti Israel iti agnanayon.",
			"8": "<sup>8</sup> Ket dagiti annac ti Israel inaramidda a casta cas imbilin ni Josue, ket nangalada iti sangapulo ket dua a batbato iti tengnga ti Jordan, cas ni Jehova sinaona ken ni Josue, cas iti bilang dagiti caputotan dagiti annac ti Israel; ket intogotda ida iti nagdagusanda, ket indissoda ida sadiay.",
			"9": "<sup>9</sup> Ket ni Josue nangicabil iti sangapulo ket dua a batbato iti tengnga ti Jordan iti disso a nagtacderan dagiti sacsaca dagiti papadi a nangawit idi lacasa ti tulag: ket addada idiay agingga itoy nga aldaw.",
			"10": "<sup>10</sup> Ta dagiti papadi a nangawit idi lacasa nagtacderda iti tengnga ti Jordan, aginggana iti naturpos amin a banag a ni Jehova imbilinna ken Josue a saoenna cadagiti tattao, cas mayalubog cadagiti isu-amin a ni Moises imbilinna idi ken ni Josue: ket dagiti tattao nagdarasda ket nagballasiwda.",
			"11": "<sup>11</sup> Ket naaramid, nga idi amin dagiti tattao nalpasdan ti nagballasiw, a di lacasa ni Jehova naiballasiw, ken dagiti papadi, iti saclang dagiti tattao.",
			"12": "<sup>12</sup> Ket dagiti annac ni Ruben, ken dagiti annac ni Gad, ken ti cagudua ti caputotan ni Manases nagballasiwda a siiigam iti sangoanan dagiti annac ti Israel, cas ni Moises imbagana cadacuada:",
			"13": "<sup>13</sup> Aguppat a pulo a ribu dagiti nasagana a siiigam a makigubat nagballasiwda iti sango ni Jehova a napan iti pagbabacalan, cadagiti tay-ac ti Jerico.",
			"14": "<sup>14</sup> Iti daydi nga aldaw ni Jehova intan-ocna ni Josue iti imatang ti isu-amin nga Israel; ket nagbutengda kencuana a cas iti panagbutengda ken Moises iti amin nga al-aldaw ti panagbiagna.",
			"15": "<sup>15</sup> Ket ni Jehova nagsao ken Josue, a kinunana,",
			"16": "<sup>16</sup> Bilinem dagiti papadi nga agawit iti lacasa ti tulag, a sumang-atda iti Jordan.",
			"17": "<sup>17</sup> Ni Josue ngarud binilinna dagiti papadi, a kinunana, Sumang-atcayo iti Jordan.",
			"18": "<sup>18</sup> Ket naaramid, nga idi a dagiti papadi a nangawit idi lacasa ti tulag ni Jehova simmang-atda nanipud iti tengnga ti Jordan, ket dagiti dapdapan dagiti sacsaca dagiti papadi naitacdangdan iti namaga a daga, a dagiti dandanum ti Jordan nagsublida iti lugarda, ket naglippiasda cadagiti isu-amin a tepteppangna a cas met la idi casisigudna.",
			"19": "<sup>19</sup> Ket dagiti tattao simmang-atda idiay Jordan iti maicasangapulo nga aldaw ti umuna a bulan, ket nagpacarsoda idiay Gilgal, iti beddeng a daya ti Jerico.",
			"20": "<sup>20</sup> Ket dagidi sangapulo ket dua a batbato, nga innalada idiay Jordan, ni Josue insaadna ida idiay Gilgal.",
			"21": "<sup>21</sup> Ket nagsao cadagiti annac ti Israel, a kinunana, Intono dagiti annacyo saludsodendanto cadagiti ammada iti mapasungad a tiempo, a cunaenda, Ania ti caipapananda dagitoy a batbato?",
			"22": "<sup>22</sup> Isu ti panangipacaammoyonton coma cadagiti annacyo, a cunaenyo, Ti Israel nagballasiw ditoy Jordan iti namaga a daga.",
			"23": "<sup>23</sup> Ta ni Jehova a Diosyo pinagmagana dagiti dandanum ti Jordan nanipud iti sangoyo, inggana iti nacaballasiwcayo, cas ni Jehova a Diosyo inaramidna iti Baybay a Nalabaga, isu a pingmagana iti sangoananmi, inggana idi nacaballasiwcami,",
			"24": "<sup>24</sup> Tapno isu-amin a tattao ditoy lubong maammoanda coma ti ima ni Jehova, nga isu mannacabalin: tapno agbutengcayo coma ken Jehova a Diosyo iti agnanayon."
		},
		"5": {
			"1": "<sup>1</sup> Ket naaramid, nga idi dagiti amin nga ar-ari dagiti Amorreo, nga addada iti ballasiw wti Jordan iti laudenna, ken amin dagiti ar-ari dagiti Cananeos, nga adda iti igid ti baybay, nangngegda no casano ti panangpamaga ni Jehova cadagiti dandanum ti Jordan nanipud iti sangoanan dagiti annac ti Israel, inggana iti nacaballasiwcami, a dagiti puspusoda nagrunawda, ket awanen ti ingel cadacuada, a gapu cadagiti annac ti Israel.",
			"2": "<sup>2</sup> Iti daydi a tiempo ni Jehova kinunana ken ni Josue, Mangaramidca cadagiti im-imuco a pamulinawen ket cugitem manen a piduaen dagiti annac ti Israel.",
			"3": "<sup>3</sup> Ket ni Josue nangaramid cadagiti im-muco a pamulinawen, ket kinugitna dagiti annac ti Israel idiay turod dagiti akinsango a cudil.",
			"4": "<sup>4</sup> Ket daytoy ti gapuna a ni Josue nangcugit idi: isu-amin a tattao a rimmuar idiay Egipto, a lallaki, a dagiti amin a tattao met laeng ti gubat natayda iti let-ang iti dalan, iti calpasan ti iruruarda idiay Egipto.",
			"5": "<sup>5</sup> Ta isu-amin a tattao a rimmuar idiay Egipto nacugitda; ngem isu-amin a tattao a nayanac iti let-ang iti dalan idi naggapuda idiay Egipto, saanda a nagcugit.",
			"6": "<sup>6</sup> Ta dagiti annac ti Israel nagnada bayat iti uppat a pulo a tawen idiay let-ang, agingga iti amin a nacion, a cadagiti tattao met laeng ti gubat a rimmuar idiay Egipto, naibusda, agsipud ta dida impangag ti timec ni Jehova; isuda a nangisapataan ni Jehova a dina palubosan ida a cumita iti daga isu a ni Jehova isapatana cadagiti ammada nga itedna coma cadacami, maysa a daga a pagayusan ti gatas ken diro.",
			"7": "<sup>7</sup> Ket dagiti annacda, isuda a binangonna iti saadda, ni Josue kinugitna ida: ta saanda a nacugit, agsipud ta dida kinugit ida iti dalan.",
			"8": "<sup>8</sup> Ket naaramid, nga idi nalpasda a kinugit amin ti nacion, a nagyanda cadagiti disdissoda idiay pacarso, aginggana naimbaganda.",
			"9": "<sup>9</sup> Ket ni Jehova kinunana ken Josue, Ita nga aldaw inlisic cadacayo ti pannacababalaw ti Egipto. Gapuna a ti nagan daydiay a lugar nainaganan Gilgal, inggana ita nga aldaw.",
			"10": "<sup>10</sup> Ket dagiti annac ti Israel nagpacarsoda idiay Gilgal; ket nagpascuada idi maicasangapulo ket uppat nga aldaw ti bulan iti rumabii cadagiti tantanap ti Jerico.",
			"11": "<sup>11</sup> Ket nanganda iti apit ti daga iti bigat iti calpasan ti pascua, cadagiti bibingca nga di-nalivaduraan ken bucbukel a kinirog, iti daydi met la nga aldaw.",
			"12": "<sup>12</sup> Ket ti mana nagsardeng iti bigat, idi calpasan ti pannanganda iti apit ti daga; dagiti annac ti Israel awanen ti manada uray caano; no di ket nanganda iti bunga ti daga ti Canaan iti daydi a tawen.",
			"13": "<sup>13</sup> Ket naaramid, nga idi a ni Josue adda iti denna ti Jerico, nga intangadna dagiti matana ket kimmita, ket adtoy, ti maysa a lalaki a nagtacder iti sangona a siaasut ti campilanna idi imana: ket ni Josue immasideg kencuana, ket kinunana kencuana, Sica cumapponca cadacami? wenno sica cumabusorca cadacami?",
			"14": "<sup>14</sup> Ket isu kinunana, Saan; ngem siac cas  principe ti buyot ni Jehova nga umayac ita. Ket ni Josue nagpacleb iti daga, ket nagdaydayaw, ket kinunana kencuana, Ania ti cuna ni Apoc iti adipenna?",
			"15": "<sup>15</sup> Ket ti principe ti buyot ni Jehova kinunana ken Josue, Iccatem ta zapatosmo ita sacam; ta iti disso a nagtacderam isu ti nasantoan. Ket ni Josue tinungpalna a casta."
		},
		"6": {
			"1": "<sup>1</sup> Ti Jerico napunitan a naimbag a gapu cadagiti annac ti Israel: awan a pulos ti macaruar ket awan met ti macastrec.",
			"2": "<sup>2</sup> Ket ni Jehova kinunana ken Josue, Kitaem, inyawatco ita imam ti Jerico, ken iti arina, ken dagiti tattao a maingel.",
			"3": "<sup>3</sup> Ket lawlawemto ti ili, amin dagiti tattao ti gubat, lawlawenyonto iti maminsan ti ili. Casta ti aramidemto cadagiti innem nga al-aldaw.",
			"4": "<sup>4</sup> Ket pito a papadi mangicuyogdanto cadagiti pito a tangtangguyob a sara ti carcarnero a lallaki iti sango ti lacasa: ket iti maicapito nga aldaw lawlawenyonto ti ili iti maminpito a dardaras, ket dagiti papadi paguniendanto dagiti tangtangguyob.",
			"5": "<sup>5</sup> Ket isunto, nga, intono pagtimkenda a napaut ti tangguyob a sara ti carnero a lalaki, ken intono mangegyo ti timec ti tangguyob, isu-amin a tattao agriawdanto iti natbag nga ariwawa; ket ti bacud ti ili margaayto a mairipap, ket dagiti tattao sumang-atdanto tunggal maysa a sililinteg iti sangoananna.",
			"6": "<sup>6</sup> Ket ni Josue nga anac ni Nun inayabanna dagiti papadi, ket kinunana cadacuada, Alaenyo ti lacasa ti tulag, ket pito a papadi mangicuyogda coma cadagiti pito a tangtangguyob a sara ti carcarnero a lallaki iti sangoanan ti lacasa ni Jehova.",
			"7": "<sup>7</sup> Ket isuda kinunada cadagiti tattao, Magnacayo, ket lawlawenyo ti ciudad, ket dagiti siiigam a tattao magnada coma iti sangoanan ti lacasa ni Jehova.",
			"8": "<sup>8</sup> Ket idi a casta, nga, idi a ni Josue nagsao cadagiti tattao, dagiti pito a papadi a siiggem cadagiti pito a tangtangguyob a sara dagiti carcarnero a lallaki nagnada iti sangoanan ni Jehova, ket pagpagunienda dagiti tangtangguyob: ket ti lacasa ti tulag ni Jehova sinurotna ida.",
			"9": "<sup>9</sup> Ket dagiti siiigam a tattao napanda iti sangoanan dagiti papadi nga agpagpaguni idi cadagiti tangtangguyob, ket dagiti buybuyot simmurotda idi lacasa, dagiti sacerdote pagpagunienda dagiti tangguyob idi a magmagnada.",
			"10": "<sup>10</sup> Ket ni Josue binilinna dagiti tattao, a kinunana, Dicayto agririaw, saan coma a mangngeg ti timecyo, saanto a sumngaw ti uray ania a sao dita ngiwatyo, aginggana iti aldaw a panangibagac cadacayo nga agriawcayo; isunto ti panagriawyon.",
			"11": "<sup>11</sup> Iti casta pinailawlawna di lacasa ni Jehova iti ili, a linicmutda iti naminsan: ket napanda iti pacarso ket nagtaengda iti pacarso.",
			"12": "<sup>12</sup> Ket ni Josue bimmangon a nasapa unay iti bigat, ket dagidi papadi binagcatda di lacasa ni Jehova.",
			"13": "<sup>13</sup> Ket dagiti pito a papadi a siiggem cadagiti pito a tangguyob a sara ti carcarnero a lallaki iti sangoanan ti lacasa ni Jehova napanda a cancanayon, ket pinagtimecda dagiti tangguyob: ket dagiti siiigam a tattao napanda iti sangoananda; ket dagiti buybuyot simmurotda iti lacasa ni Jehova, a dagiti papadi pagtimtimkenda dagiti tangguyobda idi a magmagnada.",
			"14": "<sup>14</sup> Ket iti maicadua nga aldaw linawlawda ti ili iti naminsan, ket nagsublida iti pacarso: casta ti inaramidda iti innem nga aldaw.",
			"15": "<sup>15</sup> Ket naaramid iti maicapito nga aldaw, a bimmangonda a nasapa unay iti parbangon, ket linawlawda di ili iti casdi met laeng iti naminpito a daras: daydi laeng nga aldaw ti pananglawlawda iti ili cadagiti naminpito a daras.",
			"16": "<sup>16</sup> Ket naaramid idi maicapito a daras, idi a dagiti papadi pinagunida dagiti tangguyobda, a ni Josue kinunana cadagiti tattao, Agriawcayo; ta ni Jehova intedna cadacayo ti ili.",
			"17": "<sup>17</sup> Ket ti ili maipaayto, isu met laeng ken dagiti isu-amin nga adda iti unegna, ken ni Jehova; ni laeng Raab a balangcantis ti agbiagto, isu ken isu-amin nga adda a cadduana iti balay, agsipud ta inlemmengna dagiti babaonen nga imbaontayo.",
			"18": "<sup>18</sup> Ngem dacayo, isuna laeng a liclicanyo ti banag a naipaay, di la ket ta idi nga impaayyo, no mangalacayo iti naipaay; iti casta aramidenyo a mailunod ti pacarso ti Israel, ket isu ti riribukenyo.",
			"19": "<sup>19</sup> Ngem isu-amin a pirac ken balitoc, ken al-alicamen a suer ken landoc nasantoandanto ken Jehova: maiyegdanto iti paggamengan ni Jehova.",
			"20": "<sup>20</sup> Iti casta dagiti tattao nagpuccawda, ket dagiti papadi pinagunida dagiti tangguyobda: ket naaramid, idi a dagiti tattao nangegda di aweng di tangguyob, a dagiti tattao nagriawda iti natbag nga ariwawa, ket di bacud nargaay a nasimpa, iti casta dagiti tattao simrecda iti ili, tunggal tao a nanglinteg iti sangona, ket innalada di ili.",
			"21": "<sup>21</sup> Ket pinatayda nga inkisap amin nga adda iti uneg ti ili, lalaki man ken babai agpadpada, ubing man ken lacay agpadpada, ken vaca, ken carnero, ken asno, iti tadem ti campilan.",
			"22": "<sup>22</sup> Ket ni Josue kinunana cadagiti dua a tattao a nagsiim iti daga, Sumreccayo iti balay ti babai a balangcantis, ket iruaryo ditoy ti babai, ken isu-amin a cucuana, a cas insapatayo kencuana.",
			"23": "<sup>23</sup> Ket dagiti agtutubo a lallaki a nagsiim simrecda, ket inruarda ni Raab, ken ni amana, ken ni inana, ken dagiti cacabsatna, ken isu-amin a cucuana; isu-amin a cacabagianna casta met nga inruarda; ket incabilda ida iti ruar ti pacarso ti Israel.",
			"24": "<sup>24</sup> Ket pinuuranda di ili iti apuy, ken isu-amin nga adda kencuana; ti laeng pirac, ken balitoc, ken dagiti al-alicamen a suer ken landoc, ti indulinda iti paggamengan ti balay ni Jehova.",
			"25": "<sup>25</sup> Ngem ni Raab a balangcantis, ken dagiti cabbalay ni amana, ken amin a cucuana, isuda laeng ti nabiag nga inispal ni Josue; ket ni Raab  nagnaed iti tengnga ti Israel inggana ita nga aldaw, ta inlemmengna dagidi babaonen nga ni Josue imbaonna idi a mangsiim iti Jerico.",
			"26": "<sup>26</sup> Ket ni Josue incumitna cadacuada ti maysa a sapata iti daydi a tiempo, a kinunana, Mailunod ti tao iti saclang ni Jehova, ti tumacder ken mangbangon itoy ili a Jerico: ti mangicabilto iti cimientona matayto ti anacna nga inauna, ket ti mangicabilto cadagiti ruruanganna matayto ti anacna nga inaudi.",
			"27": "<sup>27</sup> Iti casta, ni Jehova adda idi ken ni Josue; ket ti damagna naisacnap iti isu-amin a daga."
		},
		"7": {
			"1": "<sup>1</sup> Ngem dagiti annac ti Israel nacaaramidda iti panaglabsing iti banag a naipaay; ta ni Acan, nga anac a lalaki ni Carmi, nga anac a lalaki ni Zabdi, nga anac a lalaki ni Zera, ti caputotan ni Juda, nangala iti banag a naipaay: ket ti pungtot ni Jehova simged a maibusor cadagiti anac ti Israel.",
			"2": "<sup>2</sup> Ket ni Josue nangibaon cadagiti tattao nanipud Jerico agingga iti Ai, a caabay ti Beth-aven, iti bangir a daya ti Beth-el, ket nagsao cadacuada, a kinunana, Sumang-atcayo ket siimenyo ti daga. Ket dagiti tattao simmang-atda ket siniimda ti Ai.",
			"3": "<sup>3</sup> Ket nagsublida ken Josue, ket kinunada kencuana, Dica coma pasang-aten amin dagiti tattao; no saan laeng a dua wenno tallo a ribu a tattao ti sumang-at ken mangcabil iti Ai; dica pagbannogen amin a tattao idiay; ta bassitda unay.",
			"4": "<sup>4</sup> Iti casta simmang-atda idiay dagiti tattao nga agtallo a ribu: ket nagtarayda nanipud iti sangoanan dagiti tattao a taga Ai.",
			"5": "<sup>5</sup> Ket dagiti tattao a taga Ai nangpatayda cadacuada iti agtallopulo ket innem a tattao; ket kinamatda ida nanipud sangoanan ti ruangan inggana iti Sebarim, ket kinabilda ida iti salugan: ket dagiti puspuso dagiti tattao nagrunaw, ket nagbalin a cas danum.",
			"6": "<sup>6</sup> Ket ni Josue pinigisna dagiti pagan-anayna, ket nagpacleb iti daga iti sangoanan ti lacasa ni Jehova inggana iti malem, isu ken dagiti lallacay ti Israel; ket tinapocanda dagiti ol-oloda.",
			"7": "<sup>7</sup> Ket ni Josue kinunana, Ay, O Apo Jehova, ania ti gapuna a inyegmo dagiti isu-amin a tattao iti ballasiw ti Jordan, tapno yawatnacami iti ima dagiti Amorreo, tapno papatayendacami? napneccami ken nagbaticami la coman iti ballasiw ti Jordan!",
			"8": "<sup>8</sup> O, Apo, ania ti saoecto, iti calpasan a ti Israel timmallicud iti sangoanan dagiti cabusorna!",
			"9": "<sup>9</sup> Ta dagiti Cananeo ken isu-amin nga agnaed iti daga isu ti madamagdanto, ket alicubcubendacamto, ket iccatendanto ti naganmi iti daga: ket ania ti aramidemto a maipaay iti naindaclan a naganmo?",
			"10": "<sup>10</sup> Ket ni Jehova kinunana ken Josue, Bumangonca; ania ti gapuna aya a nagpaclebca?",
			"11": "<sup>11</sup> Ti Israel nagbasol, wen, isuda sinalungasingda ti tulagco nga imbilinco cadacuada: wen, isuda nangalada iti banag a naipaay, ket nagtacawda met, ken nagulbodda met; ken isu ti indulinda iti tengnga dagiti al-alicamenda met laeng.",
			"12": "<sup>12</sup> Gapuna a dagiti annac ti Israel dida mabalin ti agtacder iti sango dagiti cabusorda; timmallicudda iti sangoanan dagiti cabusorda, agsipud ta nagbalinda a nailunod: uray caanoman awanacton cadacayo, malacsid no dadaelenyo ti naipaay a banag nga adda iti tengngayo.",
			"13": "<sup>13</sup> Tumacderca, Santificarem dagiti tattao, ket cunam, Agsantificarcayo cadacayo met laeng inggana iti bigat: ta castoy ti cuna ni Jehova, a Dios ti Israel, Adda banag a naipaay iti tengngam, O Israel; dica mabalin ti agtacder iti sangoanan dagiti cabusormo, inggana iti dica ibelleng ti banag a naipaay manipud iti tengngayo.",
			"14": "<sup>14</sup> Intono bigat ngarud mayasidegcayto cadagiti capcaputotanyo: ket maaramidto, a ti caputotan nga alaen ni Jehova umasidegto cadagiti finamfamilia; ket ti familia a ni Jehova alaennanto umasidegto cadagiti cabbalay; ket ti cabbalay a ni Jehova alaennanto umasidegto a masaggaysa ti tao.",
			"15": "<sup>15</sup> Ket maaramidto, a daydiay a naala agraman ti banag a naipaay mapuuranto iti apuy, isu ken isu-amin nga adda kencuana; agsipud ta sinalungasingna ti tulag ni Jehova, ken agsipud ta nangaramid iti kinamauyong iti Israel.",
			"16": "<sup>16</sup> Iti casta ni Josue bimmangon a nasapa iti bigat, ket inyasidegna ti Israel cadagiti pinutonputot: ket ti caputotan ni Juda naala:",
			"17": "<sup>17</sup> Ket isu inyasidegna iti familia ni Juda: ket innalana ti familia dagiti Zeratas: ket inyasidegna ti familia dagiti Zeratas a sinaggaysa, ken naala ni Zabdi:",
			"18": "<sup>18</sup> Ket inyasidegna ti cabbalay a sinaggaysa: ket ni Acan, nga anac a lalaki ni Carmi, nga anac a lalaki ni Zabdi, nga anac a lalaki ni Zera, ti caputotan ni Juda, naala.",
			"19": "<sup>19</sup> Ket ni Josue kinunana ken ni Acan, Anacco, Agdawatac kenca, itedmo ti pammadayaw ken Jehova, a Dios ti Israel, ket agpudnoca kencuana: ket palawagem caniac itatta no ania ti inaramidmo; dica ilibac caniac.",
			"20": "<sup>20</sup> Ket ni Acan simmungbat ken Josue, ket kinunana, Iti kinapudnona nacabasolac iti maicaniwas ken Jehova, a Dios ti Israel, ket castoy ti inaramidco:",
			"21": "<sup>21</sup> Idi nakitac iti tengnga ti samsam ti nasayaat a dalungdong a taga Babilonia, ken dua a gasut a siclo a pirac, ken maysa a bengngal a balitoc a limapulo a siclo ti gantingna, idin inagumac ida, ket innalac ida: ket adtoy, a nailemmengda iti daga iti tengnga ti toldac, ket ti pirac iti babana.",
			"22": "<sup>22</sup> Iti casta ni Josue nagbaon cadagiti babaonen, ket nagtarayda a napan iti tolda; ket, adtoy, a nailemmeng iti toldana, ket ti pirac iti babana.",
			"23": "<sup>23</sup> Ket innalada idi nanipud iti tengnga ti tolda, ket inyegda ida ken Josue, ken cadagiti isu-amin nga annac ti Israel: ket indissoda ida iti sangoanan ni Jehova.",
			"24": "<sup>24</sup> Ket ni Josue, ken isu-amin nga Israel a kimmuyog kencuana, innalada ni Acan nga anac a lalaki ni Zera ken ti pirac, ken ti dalungdong ken ti bengngal a balitoc, ken dagiti annacna a lallaki, ken annacna a babbai, dagiti vacana, ken dagiti asnona, ken dagiti carnerona, ken ti toldana, ken isu-amin nga adda kencuana: ket inyegda ida iti lobong ti Acor.",
			"25": "<sup>25</sup> Ket ni Josue kinunana, Apayapay aya a riniribucnacami? ni Jehova riribukennaca ita nga aldaw. Ket isu-amin a Israelitas isu inuburda cadagiti batbato; ket pinuuranda ida, ket inuburda ida cadagiti batbato.",
			"26": "<sup>26</sup> Ket namatacderda iti rabawna iti dackel a gabsuon ti bato iti daydi nga aldaw; ket ni Jehova nagbaw-ing nanipud iti kinarungsot ti pungtotna. Gapuna a ti nagan daydiay a lugar nanaganan, Ti lobong ti Acor inggana ita nga aldaw."
		},
		"8": {
			"1": "<sup>1</sup> Ket ni Jehova kinunana ken Josue, Dica agbuteng, ken dica met agcullayaw: alaem a cumuyog kenca amin a tattao ti gubat ket tumacderca, sumangatca idiay Ai; kitaem, nga inyawatco ita imam ti ari ti Ai, ken dagiti tattaona, ken ti ilina, ken ti dagana:",
			"2": "<sup>2</sup> Ket aramidemto iti Ai ken iti arina ti cas inaramidmo iti Jerico ken iti arina: isuna laeng ti samsamna, ken dagiti an-animalna, ti alaemto a cayawyo: mangisaadca iti maysa a pagsaneban a maipaay iti ili iti licudanna.",
			"3": "<sup>3</sup> Iti casta ni Josue timmacder, ken amin dagiti tattao ti gubat, a mapan sumang-at idiay Ai: ket ni Josue pimmili iti tallo ribu a tattao, tattao a mamaingel, ket imbaonna ida iti rabii.",
			"4": "<sup>4</sup> Ket imbilinna cadacuada, a cunana, Adtoy, agsanebcayto a maibusor iti ili iti licudan ti ili; dicayo adayuan unay ti ili, no di ket sisasaganacayo amin:",
			"5": "<sup>5</sup> Ket siac, ken amin dagiti tattao nga adda caniac, umadanicamto iti ili. Ket maaramidto, nga intono rumuarda a sumaranget cadacami, a cas idi immuna, nga agtaraycaminto manipud iti sangoananda;",
			"6": "<sup>6</sup> Ket surotendacaminto, inggana iti mayadayumi ida manipud iti ili; ta cunadanto, nagtarayda iti sangotayo a cas idi immun-una: iti casta agtaraycaminto manipud iti sangoananda.",
			"7": "<sup>7</sup> Ket tumacdercayto iti pagsaneban, ket alaenyonto ti ili: ta ni Jehova a Diosyo yawatnanto ita imayo.",
			"8": "<sup>8</sup> Ket isunto, nga intono malasudanyo ti ili, puuranyonto ti ili; cas iti sao ni Jehova ti aramidenyonto: kitaenyo, Siac imbilinco cadacayo.",
			"9": "<sup>9</sup> Ket ni Josue imbaonna ida: ket napanda iti pagsaneban, ket nagyanda iti nagbaetan ti Bet-el ken Ai, iti deppaar a laud ti Ai: ngem ni Josue nakipagnaed cadagiti tattao iti daydi a rabii.",
			"10": "<sup>10</sup> Ket ni Josue bimmangon a nasapa iti bigat, ket inurnosna dagiti tattao, ket simmang-atda, isu ken dagiti lallacay ti Israel, iti sango dagiti tattao sadi Ai.",
			"11": "<sup>11</sup> Ket isu-amin dagiti tattao, a dagiti met laeng tattao ti gubat nga adda kencuana, simmang-atda, ket dimtengda, ket immayda iti sango ti ili, ket nagpacarsoda iti abay nga amianan ti Ai: ket adda lobong a nagbaetanda isu ken iti Ai.",
			"12": "<sup>12</sup> Ket nangala iti aglima a ribu a tattao, ket incabilna ida iti pagsaneban iti nagbaetan ti Bet-el ken Ai, iti deppaar a laud ti ili.",
			"13": "<sup>13</sup> Iti casta insaadna dagiti tattao, a ti met laeng amin a buyot nga adda iti deppaar nga amianan ti ili, ken dagiti agsaneb addada iti bangir a laud ti ili; ket ni Josue napan iti daydi a rabii iti nagtengngaan ti lobong.",
			"14": "<sup>14</sup> Ket naaramid idi a ti ari ti Ai isu nakitana, nagdardaras ket bimmangon a nasapa, ket dagiti tattao ti ili rimmuarda a nanggubat a maibusor iti Israel, isu ken dagiti isu-amin a tattaona, iti tiempo a natudingan, iti sangoanan ti Araba; ngem dina ammo nga adda maysa a pagsaneban a maibusor kencuana iti licudan ti ili.",
			"15": "<sup>15</sup> Ket ni Josue ken amin nga Israel inaramidda ti cas la no maabacda iti sangoananda, ket nagtarayda iti dalan nga agpalet-ang.",
			"16": "<sup>16</sup> Ket isu-amin dagiti tattao nga adda iti ili naayabanda a naummong a cumamat cadacuada; ket sinurotda ni Josue, ket nairuarda iti ili.",
			"17": "<sup>17</sup> Ket awan ti nabati a lalaki idiay Ai wenno idiay Beth-el, a saan a napan kimmamat iti Israel: ket pinanawanda ti ili a silulucat, ket kinamatda ti Israel.",
			"18": "<sup>18</sup> Ket ni Jehova kinunana ken Josue. Itayagmo ta gayang nga adda ita imam a iturongmo iti Ai; ta isu yawatconto ita imam. Ket ni Josue intayagna di gayang nga adda idi imana a maiturong iti ili.",
			"19": "<sup>19</sup> Ket dagiti agsaneb timmacderda a nasingdat iti yanda, ken nagdarisonda idi apaman nga intayagna di imana, ket sinerrecda di ili ket innalada: ket nagsiglatda, ket pinuuranda di ili.",
			"20": "<sup>20</sup> Ket idi a dagiti tattao ti Ai timmalliawda iti licudanda, kimmitada, ket, adtoy, a ti asoc ti ili nagpangato idi nga agpalangit, ket awan ti pannacabalinda nga agtalaw itoy a dalan wenno idiay a dalan; ket dagiti tattao a nagtalawda idi a nagpalet-ang simmangoda cadagidi agcamcamat.",
			"21": "<sup>21</sup> Ket idi a ni Josue ken isu-amin nga Israel nakitada a dagiti agsaneb naaladan ti ili ken di asoc ti ili nagpangato idi, iti casta nagsublida manen, ket pinapatayda dagiti tattao ti Ai.",
			"22": "<sup>22</sup> Ket dagiti dadduma rimmuarda iti ili a bumosor cadacuada; iti casta nga addada idi iti tengnga ti Israel, dagiti dadduma itoy a sikigan, ket dagiti dadduma idiay a sikigan: ket kinabilda ida, iti casta nga awan ti tiniddada cadacuada wenno nacatalaw.",
			"23": "<sup>23</sup> Ket ti ari ti Ai innalada a sibibiag ket isu inyegda ken Josue.",
			"24": "<sup>24</sup> Ket naaramid, idi a ti Israel nalpasnan ti panagpapatayna cadagiti isu-amin a naed ti Ai iti away, iti let-ang a nagsurotanda cadacuada, ket napasagda amin iti tadem ti campilan, inggana iti napucawda, ket iti casta nga isu-amin nga Israel nagsublida iti Ai ket isu kinabilda iti tadem ti campilan.",
			"25": "<sup>25</sup> Ket ti dagup ti napasag iti daydi nga aldaw, lallaki ken babbai, sangapulo ket dua a ribu, nga amin met laeng a tattao ti Ai.",
			"26": "<sup>26</sup> Ta ni Josue dina binaw-ing di imana isu a pinangitayagna idi gayang, inggana iti napucawna a natalipupus amin dagiti tattao ti Ai.",
			"27": "<sup>27</sup> Dagiti laeng an-animal ken dagiti sinamsam ti ili ti innala ti Israel a kinayawan a maipaay cadacuada, a mayalubog iti sao ni Jehova, nga imbilinna ken Josue.",
			"28": "<sup>28</sup> Iti casta ni Josue pinuuranna ti Ai, ket isu inaramidna a maysa a gabsuon nga agnanayon, maysa a kinawalangwalang met laeng, inggana ita nga aldaw.",
			"29": "<sup>29</sup> Ket binitayna ti ari ti Ai aginggana iti rumabii: ket idi a ti init bumaba ni Josue nagbilin, ket imbabada di bangcayna idi cayo, ket isu impalladawda iti ruangan ti ili, ket ginaburanda iti dackel a gabsuon dagiti batbato, aginggana ita nga aldaw.",
			"30": "<sup>30</sup> Idin ni Josue nangbangon iti altar ken Jehova, a Dios ti Israel, idiay bantay Ebal,",
			"31": "<sup>31</sup> Cas ni Moises nga adipen ni Jehova imbilinna cadagiti annac ti Israel, cas naisurat iti libro ti linteg ni Moises, maysa nga altar a batbato a di natagaan, nga iti rabawda awan ti siasinoman a tao a nangingato iti landoc: ket kencuana nangidatonda ken Jehova cadagiti datdaton a mapuuran, ken nangirucbabda cadagiti datdaton ti cappia.",
			"32": "<sup>32</sup> Ket idiay insuratna iti rabaw dagiti batbato ti maysa a copia ti linteg ni Moises, isu nga insuratna iti imatang dagiti annac ti Israel.",
			"33": "<sup>33</sup> Ket isu-amin nga Israel, ken dagiti lallacayda ken dagiti agturturay ken dagiti oc-ocomda, nagtacderda iti daytoy a sikigan ti lacasa ken iti dayta a sikigan iti sangoanan dagiti papadi a Levitas, a nangawit idi lacasa ti tulag ni Jehova, no casano cadagiti gangannaet casta met cadagiti umili; iti cagudduada iti sango ti bantay Gerizim, ket ti caguddua iti sango ti bantay Ebal; cas ni Moises nga adipen ni Jehova imbilinna idi unana, tapno bendicionanda coma dagiti tattao ti Israel.",
			"34": "<sup>34</sup> Ket sana insaganad nga imbasa dagiti isu-amin a sasao ti linteg, ti bendicion ken ti lunod, cas mayalubog iti amin nga adda a maisurat iti libro ti linteg.",
			"35": "<sup>35</sup> Awan idi ti sao cadagiti amin nga imbilin ni Moises a di-imbasa ni Josue iti sango ti isu-amin a gimong ti Israel, cadagiti babbai ken ububbing, ken cadagiti gangannaet nga adda cadacuada idi."
		},
		"9": {
			"1": "<sup>1</sup> Ket naaramid, nga idi nga isu-amin dagiti ar-ari nga addada idi iti ballasiw ti Jordan, iti caturodan, ken cadagiti tantanap, ken iti isu-amin nga igid ti dackel a taaw iti sango ti Libano, dagiti Heteos, Amorreos, Cananeos, Perezeos, Heveos, ken Jebuseos, nadamagda;",
			"2": "<sup>2</sup> A naguummongda, tapno makigubatda ken Josue ken iti Israel iti maymaysa a timpuyog.",
			"3": "<sup>3</sup> Ngem idi a dagiti agnaed iti Gabaon natimudda no ania ti inaramid idi ni Josue iti Jerico ken iti Ai,",
			"4": "<sup>4</sup> Isuda nangaramatda met iti sicap, ket napanda ket nagaramidda a casda la nabaon, ket nangalada cadagiti supsupot a daan nga imparabao cadagiti asnoda, ken cadagiti lallalat a pagiccan ti arac, daan ken napigis, ken napunggos,",
			"5": "<sup>5</sup> Ken zapzapatos a daan ken tacup-tacup cadagiti sacsacada, ken cawcawes a daan cadacuada; ken isu-amin a tinapay a balonda namagaanen ken binuoten.",
			"6": "<sup>6</sup> Ket immayda idi ken Josue idiay pacarso idiay Gilgal, ket kinunada kencuana, ken cadagiti tattao ti Israel, Dacami naggapucami iti adayu unay a daga: makinomocayo ngarud ita cadacami.",
			"7": "<sup>7</sup> Ket dagiti tattao ti Israel kinunada idi cadagiti Heveos, Nalabit ngata nga agnaedcayo iti nagtengngaanmi; ket casano ngarud ti pannakinomomi cadacayo?",
			"8": "<sup>8</sup> Ket isuda kinunada ken Josue, Dacami dagiti ad-adipenmo. Ket ni Josue kinunana cadacuada, Siasinocayo aya? ken sadino aya ti naggapuanyo?",
			"9": "<sup>9</sup> Ket isuda kinunada kencuana, Nanipud iti adayu unay a daga dagiti ad-adipenmo immayda a gapu iti nagan ni Jehova a Diosmo: ta nangegmi ti damagna, ken isu-amin a banag nga inar-aramidna idiay Egipto,",
			"10": "<sup>10</sup> Ken isu-amin nga inaramidna cadagiti dua nga ar-ari dagiti Amorreos, nga addada idi iti ballasiw ti Jordan, ken Sejon nga ari ti Jesebon, ken ni Og nga ari ti Basan, nga addada idi sadi Astarot.",
			"11": "<sup>11</sup> Ket dagiti lallacaymi ken amin dagiti agnaed iti dagami nagsaoda cadacami, a cunada, Mangiggemcayo Mangiggemcayo iti balon nga agpaay iti dalan, ket incayo a sumabet cadacuada, ket cunaenyo cadacuada, Dacami dagiti ad-adipenyo: ket makinomocayo ita cadacami.",
			"12": "<sup>12</sup> Daytoy tinapaymi innalami idi a nabara cadagiti balbalaymi a maipaay iti dalan iti daydi aldaw, nga iruruarmi a umay cadacayo; ngem ita, adtoy, namagan, ken binuoten;",
			"13": "<sup>13</sup> Dagitoy lallalat ti arac, a pinunnomi, babbaroda idi: adtoy, ket napigisdan: ket dagitoy cawcawesmi ken zapzapatosmi daandan a gapu iti caunday ti pannagna.",
			"14": "<sup>14</sup> Ket dagiti tattao ti Israel innalada idi ti balonda, ket dida nagsalsaludsod iti patigmaan iti ngiwat ni Jehova.",
			"15": "<sup>15</sup> Ket ni Josue nakicappia cadacuada, ken nakinomo cadacuada a tiddaenna ida a sibibiag. Ket dagiti pangpanguloen ti gimong nagsapatada cadacuada.",
			"16": "<sup>16</sup> Ket naaramid idi naturpos dagiti tallo nga al-aldaw iti calpasan ti pannakitulagda cadacuada, nangegda nga isuda idi dagiti carcarrubada, ket agnaedda iti nagtengngaanda.",
			"17": "<sup>17</sup> Ket dagiti annac ti Israel nagnada, ket dimtengda cadagiti il-ilida iti maicatlo nga aldaw. Ket dagiti il-ilida isuda idi ti Gabaon, ken Cafira, ken Berot, ken Kiryat-jearim.",
			"18": "<sup>18</sup> Ket dagiti annac ti Israel saanda a kinabil ida, agsipud ta dagiti pangpanguloen ti gimong insapatada cadacuada gapu ken Jehova, a Dios ti Israel. Ket isu-amin a gimong nagtanabutob idi a maibusor cadagiti pangpanguloen.",
			"19": "<sup>19</sup> Ngem isu-amin dagiti pangpanguloen kinunada iti isu-amin a gimong, Dacami insapatami cadacuada a gapu ken Jehova, a Dios ti Israel: gapuna itatta ditay mabalin a sagiden ida.",
			"20": "<sup>20</sup> Daytoy ti aramidentayonto cadacuada, ket baybay-antayo ida nga agbiag: di la ket ta umay ti pungtot cadatayo, a gapu iti sapata nga insapatami cadacuada.",
			"21": "<sup>21</sup> Ket dagiti pangpanguloen kinunada cadacuada, Agbiagda coma: ngem isuda dagiti agpucpucan iti sungrod ken agsacsacdo a maipaay iti amin a gimong, cas dagiti pangpanguloen insaoda idi cadacuada.",
			"22": "<sup>22</sup> Ket ni Josue inayabanna ida, ket nagsao cadacuada, a cunana, Apayapay aya nga inallilawdacami, a kinunayo, Adayucami unay cadacayo: idinto a makipagtaengcayo cadacami?",
			"23": "<sup>23</sup> Gapuna ita mailunodcayo, ket dinto agcurang cadacayo ti adipen, agpada agpucan iti sungrod, ken agsacsacdo a maipaay iti balay ti Diosco.",
			"24": "<sup>24</sup> Ket isuda simmungbatda ken Josue, ket kinunada, Agsipud ta pudno a naibaga cadagiti adipenmo, no casano daydi a ni Jehova a Diosmo imbilinna idi ken ni Moises nga adipenna nga itedna cadacayo amin a daga, ken pucawenna amin dagiti agnaed iti daga iti sangoananyo; iti casta nagbutengcami unay cadacayo iti maipaay cadagiti biagmi ket inaramidmi daytoy a banag.",
			"25": "<sup>25</sup> Ket itatta, adtoy, addacami ita imam: cas iti pagarupemto coma a naimbag ken nalinteg a maaramid cadacami, aramidem.",
			"26": "<sup>26</sup> Ket inaramidna cadacuada a casta, ket incanawana ida iti ima dagiti annac ti Israel, tapno dida papatayen ida.",
			"27": "<sup>27</sup> Ket ni Josue pinagbalinna ida iti daydi nga aldaw nga agpucpucan iti sungrod ken agsacsacdo a maipaay iti gimong, ken maipaay iti altar ni Jehova inggana ita nga aldaw, iti disso nga isu pilienna idi."
		},
		"10": {
			"1": "<sup>1</sup> Naaramid, idi a ni Adonisedec nga ari ti Jerusalem natimudna no casano ti panangala ni Josue iti Ai, ket isu dinadaelna a tinalipupus (a no casano ti inaramidna iti Jerico ken iti arina, casta met ti inaramidna iti Ai ken iti arina), ken no casano ti pannakicappia dagiti agnaed iti Gabaon iti Israel, ket addada idi cadacuada;",
			"2": "<sup>2</sup> A nagamacda unay, agsipud ta ti Gabaon isu idi ti maysa nga ili a dackel, a maysa cadagiti naarian nga il-ili, ken agsipud ta dacdackel pay ngem iti Ai, ket isu-amin dagiti tattaona mamaingelda.",
			"3": "<sup>3</sup> Ngarud ni Adonisedec nga ari ti Jerusalem nagbaon ken Oham nga ari ti Hebron, ken ni Piream nga ari ti Jarmut, ken ni Jafia nga ari ti Laquis, ken ni Debir nga ari ti Eglon, a kinunana,",
			"4": "<sup>4</sup> Sumang-atcayo caniac, ket badangandac, ket cabilentayo coma ti Gabaon: ta nakicappia ken Josue ken cadagiti annac ti Israel.",
			"5": "<sup>5</sup> Gapuna a dagiti lima nga ar-ari dagiti Amorreos, ti ari ti Jerusalem, ti ari ti Hebron, ti ari ti Jarmut, ti ari ti Laquis, ti ari ti Eglon, nagtitiponda, ket simmang-atda, isuda ken isu-amin a buybuyotda, ket nagpacarsoda a maibusor iti Gabaon, ket nakigubatda a maibusor kencuana.",
			"6": "<sup>6</sup> Ket dagiti tattao ti Gabaon nagbaonda ken Josue iti pacarso idiay Gilgal, a cunana, Dica cucuten ta imam cadagiti ad-adipenmo; sumang-atca a madaras cadacami, ket ispalennacami, ket badangannacami: ta isu-amin dagiti ar-ari dagiti Amorreos nga agnaedda iti caturodan nagtitiponda a bumosor cadacami.",
			"7": "<sup>7</sup> Iti casta ni Josue simmang-at nanipud Gilgal, isu ken isu-amin dagiti tattao ti gubat kencuana, ken isu-amin dagiti tattao nga agcacamaingel.",
			"8": "<sup>8</sup> Ket ni Jehova kinunana ken Josue, Dica agbuteng cadacuada: ta inyawatco ida cadagita imam; awan ti uray asinoman a tao cadacuada nga agtacderto iti sangoanam.",
			"9": "<sup>9</sup> Ni Josue ngarud napan nga dagus cadacuada; ta simmang-at a nagpatpatnag nanipud Gilgal.",
			"10": "<sup>10</sup> Ket ni Jehova riniribucna ida iti sangoanan ti Israel, ket pinapatayna ida iti naindaclan a panangpapatay idiay Gabaon, ket kinamatda ida iti dalan ti sang-atan sadi Bet-horon ket kinabilda ida agingga iti Azeca, ken Maceda.",
			"11": "<sup>11</sup> Ket naaramid, idi agtalawda manipud sangoanan ti Israel, idi addada iti salogan idiay Bet-horon, a ni Jehova tininnaganna ida cadagiti batbato a dadackel nanipud langit, cadacuada aginggana iti Azeca, ket natayda: ad-adu dagidiay napapatay cadagiti batbato nga uraro ngem dagidiay pinapatay dagiti annac ti Israel iti campilan.",
			"12": "<sup>12</sup> Idin ni Josue nagsao ken Jehova idi aldaw a ni Jehova inyawatna dagiti Amorreos iti sangoanan dagiti annac ti Israel; ket kinunana iti imatang ti Israel, init, agintecca idiay ngato ti Gabaon; ket sica, Bulan, idiay lobong ti Ajalon.",
			"13": "<sup>13</sup> Ket ti init nagintec, ket ti bulan nagsardeng, inggana iti di nacabales ti nacion cadagiti cabcabusorda. Daytoy saan aya a naisurat iti libro ni Jasher? Ket ti init nagintec iti tengnga ti langit, ket saan a nagdaras a limnec iti dandani maysa nga aldaw.",
			"14": "<sup>14</sup> Ket awan idi ti aldaw a cas la iti daydi iti casacbayanna wenno iti calpasanna, a ni Jehova impangagna ti timec ti maysa a tao: ta ni Jehova nakigubat a gapu iti Israel.",
			"15": "<sup>15</sup> Ket ni Josue nagsubli, ken isu-amin nga Israel agraman kencuana, iti pacarso idiay Gilgal.",
			"16": "<sup>16</sup> Ket dagitoy lima nga ar-ari nagtalawda, ket naglemmengda iti rukib sadi Maceda.",
			"17": "<sup>17</sup> Ket naibaga ken Josue, a nacuna, Dagiti lima nga ar-ari nasaracanda ida, a nailemmeng iti rukib sadi Maceda.",
			"18": "<sup>18</sup> Ket ni Josue kinunana, Mangtulidcayo cadagiti dadackel a batbato agingga iti ngiwat ti rukib, ket mangisaadcayo cadagiti tattao a mangaywan cadacuada:",
			"19": "<sup>19</sup> Ngem dicayo agsardeng idiay; agcamatcayo cadagiti cabcabusoryo, ket cabilenyo ti taraudida; ket dicayo palubosan ida a sumrec cadagiti il-ilida: ta ni Jehova a Diosyo inyawatna ida iti imayo.",
			"20": "<sup>20</sup> Ket naaramid, nga idi a ni Josue ken dagiti annac ti Israel nalpasda ti nangpapatay cadacuada iti dackel a panangpapatay inggana iti napucawda ket ti natda a nabati idi cadacuada simrec cadagiti nasarikedkedan nga il-ili,",
			"21": "<sup>21</sup> Nga isu-amin a tattao nagsublida ken Josue iti pacarso idiay Maceda a sitatalna: awan ti uray maysa a mangcuti iti dilana a maibusor iti uray siasinoman cadagiti annac ti Israel.",
			"22": "<sup>22</sup> Idin kinuna ni Josue, Luctanyo ti ngiwat ti rukib, ket yegyo caniac dagiti lima nga ar-ari manipud iti rukib.",
			"23": "<sup>23</sup> Ket inaramidda a casta, ket impanda kencuana nanipud iti rukib dagiti lima nga ar-ari, ti ari ti Jerusalem, ti ari ti Hebron, ti ari ti Jerimot, ti ari ti Laquis, ti ari ti Eglon.",
			"24": "<sup>24</sup> Ket naaramid, idi nga inyegda ken Josue dagidiay nga ar-ari, a ni Josue inayabanna amin dagiti tattao ti Israel, ket kinunana cadagiti pangpangoloen dagiti tattao ti gubat a nakicuyog kencuana a napan, Umasidegcayo, ibaddecyo dagiti tengnged dagitoy nga ar-ari. Ket immasidegda, ket imbaddecda dagiti tengngedda.",
			"25": "<sup>25</sup> Ket ni Josue kinunana cadacuada, Dicayo agbuteng, dicayo met agcullayaw; pumigsacayo ken umingelcayo: ta castoy ti aramidento ni Jehova cadagiti isu-amin a cabusoryo a cabacalyo.",
			"26": "<sup>26</sup> Ket iti calpasanna ni Josue kinabilna ida, ket pinatayna ida, ket pinaibitinna ida cadagiti lima a cayo: ket naibitinda cadagiti caycayo agingga iti malem.",
			"27": "<sup>27</sup> Ket naaramid idi lumnec ti init, a ni Josue nagbilin, ket imbabada ida cadagiti caycayo, ket impalladawda ida idi rukib a naglemmenganda, ket nangicabilda cadagiti dadackel a batbato iti ngiwat ti rukib, inggana ita nga aldaw.",
			"28": "<sup>28</sup> Ket ni Josue innalana ti Maceda iti daydi nga aldaw, ket isu kinabilna iti tadem ti campilan, ken castamet ti arina: ket dinadaelna nga inkisap ida ken isu-amin a carcararua nga agnaed kencuana: awan a pulos ti tiniddana: ket inaramidna iti ari ti Maceda ti cas inaramidna iti ari ti Jerico.",
			"29": "<sup>29</sup> Ket ni Josue immallatiw nanipud Maceda, ken isu-amin nga Israel naicuyog kencuana idiay Libna, ket ginubatda ti Libna:",
			"30": "<sup>30</sup> Ket ni Jehova isu inyawatna met, ken castamet ti arina, iti ima ti Israel; ket isu kinabilna iti tadem ti campilan, ken isu-amin a carcararua nga agnaed kencuana; awan ti tiniddana; ket inaramidna iti arina cas ti inaramidna iti ari ti Jerico.",
			"31": "<sup>31</sup> Ket ni Josue immallatiw nanipud Libna, ken isu-amin nga Israel naicuyog kencuana, idiay Laquis, ket nagpacarsoda a maibusor kencuana, ket nakigubatda a maibusor kencuana:",
			"32": "<sup>32</sup> Ket ni Jehova inyawatna ti Laquis iti ima ti Israel; ket isu ti innalana iti maicadua nga aldaw, ket isu kinabilna iti tadem ti campilan, ken isu-amin a carcararua nga agnaed kencuana, cas iti amin nga inaramidna iti Libna.",
			"33": "<sup>33</sup> Idin ni Horam nga ari ti Gazer simmang-at a bumadang iti Laquis; ket ni Josue pinatayna isu ken dagiti tattaona, agingga iti awan tiniddana kencuana a nalabasan.",
			"34": "<sup>34</sup> Ket ni Josue immallatiw nanipud Laquis, ken isu-amin nga Israel naicuyog kencuana, iti Eglon; ket isuda nagpacarsoda a maibusor kencuana, nakigubatda a maibusor kencuana;",
			"35": "<sup>35</sup> Ket isu innalada iti daydi nga aldaw, ket isu kinabilda iti tadem ti campilan; ken isu-amin a carcararua nga agnaed kencuana isu dinadaelna nga inkisap iti daydi nga aldaw, cas iti amin nga inaramidna iti Laquis.",
			"36": "<sup>36</sup> Ket ni Josue simmang-at nanipud Eglon, ken amin nga Israel naicuyog kencuana, agingga iti Hebron; ket isuda nakigubatda a maibusor kencuana:",
			"37": "<sup>37</sup> Ket isu innalada, ket kinabilda iti tadem ti campilan, ken castamet ti arina, ken isu-amin dagiti il-ilina, ken isu-amin a carcararua nga agnaed kencuana; awan a pulos ti tiniddana, a cas iti amin nga inaramidna iti Eglon; no di ket dinadaelna nga inkisap, ken amin a carcararua nga agnaed kencuana.",
			"38": "<sup>38</sup> Ket ni Josue nagsubli, ken isu-amin nga Israel naicuyog kencuana, idiay Debir, ket nakigubat a maibusor kencuana:",
			"39": "<sup>39</sup> Ket isu innalana, ken castamet ti arina, ken amin dagiti il-ilina; ket kinabilda ida iti tadem ti campilan, ket dinadaelda nga inkisap dagiti isu-amin a carcararua nga agnaed kencuana; isu awan ti tiniddana: no casano ti inaramidna iti Hebron, casta ti inaramidna iti Debir, ken iti arina; a cas iti inaramidna met iti Libna, ken iti arina.",
			"40": "<sup>40</sup> Iti casta ni Josue kinabilna ti isu-amin a daga, iti caturodan, ken iti Abagatan, ken iti tanap, ken dagiti bacras dagiti banbantay, ken isu-amin dagiti ar-arida nga awan a pulos ti tiniddana, no di ket pinucawna nga inkisap amin a naganges, cas imbilin ni Jehova a Dios ti Israel.",
			"41": "<sup>41</sup> Ket ni Josue kinabilna ida nanipud Cades-barnea aginggana iti Gaza met laeng, ken isu-amin a daga ti Gosen inggana iti Gabaon met laeng.",
			"42": "<sup>42</sup> Ket isu-amin dagitoy nga ar-ari ken dagiti dagdagada ni Josue innalana iti maymaysa a tiempo, agsipud ta ni Jehova, a Dios ti Israel, nakigubat a gapu iti Israel.",
			"43": "<sup>43</sup> Ket ni Josue nagsubli, ken amin nga Israel naicuyog kencuana, iti pacarso idiay Gilgal."
		},
		"11": {
			"1": "<sup>1</sup> Ket naaramid, nga idi a ni Jabin nga ari ti Hasor nadamagna daytoy, nagbaon ken Jobab nga ari ti Madon, ken iti ari ti Simron, ken iti ari ti Acsaf,",
			"2": "<sup>2</sup> Ket cadagiti ar-ari nga addada iti amianan, iti caturodan, ken iti Araba nga abagatan ti Cineret, ken iti tanap ken cadagiti panpantoc ti Dor iti laud,",
			"3": "<sup>3</sup> Iti Cananeo iti daya ken iti laud, ken iti Amorreo, ken Heteo, ken Perezeo, ken ti Jebuseo iti caturodan ken iti Heveo nga adda iti baba ti Hermon iti daga ti Mizpa.",
			"4": "<sup>4</sup> Ket rimmuarda, isuda ken isu-amin a buyotda naicuyog cadacuada, adu a tattao, a casda la iti darat iti igid ti baybay ti caaduda, agraman cabcabayo ken luglugan nga aduda unay.",
			"5": "<sup>5</sup> Ket isu-amin dagitoy nga ar-ari nagsasaracda a nagtitipon; ket immayda ket nagpacarsoda a sangsangcatipon idiay dandanum ti Merom, tapno makigubatda iti Israel.",
			"6": "<sup>6</sup> Ket ni Jehova kinunana ken Josue, Dica agbuteng cadacuada; ta intono bigat iti daytoy a tiempo yawatconto ida amin a napapatay iti sangoanan ti Israel: ket pasatamto dagiti cabcabayoda, ket puuramto iti apuy dagiti lugluganda.",
			"7": "<sup>7</sup> Iti casta immay nga dagus ni Josue, ken isu-amin a tattao ti gubat naicuyog kencuana, a maibusor cadacuada iti denna dagiti dandanum ti Merom, ket dinuclosna ida.",
			"8": "<sup>8</sup> Ket ni Jehova inyawatna ida iti ima ti Israel, ket kinabilda ida, ket kinamatda ida inggana iti dackel a Sidon, ken iti Misrefot-mayim, ken iti lobong ti Mizpa iti agpadaya: ket kinabilda ida, nga agingga iti awan ti tiniddada.",
			"9": "<sup>9</sup> Ket ni Josue inaramidna cadacuada cas imbilin ni Jehova kencuana: isu pinasatanna dagiti cabcabayoda, ket pinuuranna iti apuy dagiti lugluganda.",
			"10": "<sup>10</sup> Ket ni Josue nagsubli iti daydi a tiempo, ket innalana ti Hazor, ket kinabilna ti arina iti campilan: ta ti Hazor isu idi ti olo dagidiay amin a pagpagarian.",
			"11": "<sup>11</sup> Ket kinabilda amin dagiti carcararua nga agnaed kencuana iti tadem ti campilan, ket dinadaelda ida nga inkisap: awan natda nga adda angesna: ket pinuuranna iti apuy ti Hazor.",
			"12": "<sup>12</sup> Ket amin dagiti il-ili dagidiay nga ar-ari, ken isu-amin nga ar-arida, innala ni Josue, ket kinabilna ida iti tadem ti campilan, ket dinadaelna ida nga inkisap; cas imbilin ni Moises nga adipen ni Jehova.",
			"13": "<sup>13</sup> Ngem cadagidiay nga il-ili a nagyan cadagiti pagsalindeganda, ti Israel awan pinuuranna, malacsid ti Hazor laeng; dayta pinuuran ni Josue.",
			"14": "<sup>14</sup> Ket isu-amin dagiti nasamsam cadagiti il-ili, ken dagiti an-animal, dagiti annac ti Israel innalada a maipaay a kinayawan cadacuada; ngem tunggal tao kinabilda iti tadem ti campilan, agingga iti nadadaelda amin ida, awan ti tiniddada nga adda angesna.",
			"15": "<sup>15</sup> Cas ni Jehova imbilinna ken Moises nga adipenna, casta met ni Moises imbilinna ken Josue: ket iti casta tinungpal ni Josue; ket awan ti dina tinungpal cadagiti isu-amin a ni Jehova imbilinna ken Moises.",
			"16": "<sup>16</sup> Iti casta ni Josue innalana amin dayta a daga, iti caturodan, ken amin nga Abagatan, ken amin a daga ti Gosen, ken dagiti tanap, ken ti Araba, ken ti caturodan ti Israel, ken ti tanapna met laeng;",
			"17": "<sup>17</sup> Manipud iti bantay Halac, a sumang-at idiay agingga ti Seir, aginggana ti Baal-gad met laeng iti lobong ti Libano iti baba ti bantay Hermon: ken isu-amin nga ar-arida innalana, ket kinabilna ida, ket pinatayna ida.",
			"18": "<sup>18</sup> Ni Josue nabayag a nakigubgubat cadagidiay amin nga ar-ari.",
			"19": "<sup>19</sup> Awan ti ili a nakicappia cadagiti annac ti Israel, malacsid dagiti Heveos a nagtaeng idiay Gabaon: isuda amin innalada iti gubat.",
			"20": "<sup>20</sup> Ta naggapu idi ken Jehova ti panangpatangken cadagiti puspusoda, tapno umayda a maibusor iti Israel iti paggugubatan, tapno pucawenna ida nga ikisap, tapno dida macaasian coma idi, no di ket tapno pucawenna coma ida, cas ni Jehova imbilinna ken Moises.",
			"21": "<sup>21</sup> Ket ni Josue immay iti daydi a tiempo, ket iniccatna dagiti Anaceos iti caturodan, iti Hebron, iti Debir, iti Anab, ken iti isu-amin a caturodan ti Juda, ken iti isu-amin a caturodan ti Israel: ni Josue dinadaelna nga inkisap ida agraman dagiti ililida.",
			"22": "<sup>22</sup> Awan idi ti Anaceo a tiniddada iti daga dagiti annac ti Israel; no saan laeng a idiay Gaza, idiay Gat, ken idiay Asdod, ti nangitiddaanda cadagiti dadduma.",
			"23": "<sup>23</sup> Iti casta ni Josue innalana dagup amin a daga, cas mayalubog cadagiti isu-amin a ni Jehova sinaona ken Moises; ket ni Josue intedna a tawid ti Israel a mayalubog iti bingbingayda iti caputotanda. Ket ti daga naginana iti gubat."
		},
		"12": {
			"1": "<sup>1</sup> Ita dagitoy dagiti ar-ari ti daga, isuda a kinabil dagiti annac ti Israel, ket tinagicuada dagiti dagdagada iti ballasiw ti Jordan nga agturong iti leleggacan ti init, manipud iti lobong ti Arnon inggana iti bantay Hermon, ken isu-amin nga Araba nga agpadaya:",
			"2": "<sup>2</sup> Ni Sehon nga ari dagiti Amorreos, a nagnaed idiay Hesbon, ken nagturay manipud Aroer, nga adda iti igid ti lobong ti Arnon, ken iti ili nga adda iti tengnga ti lobong, ken caguddua ti Galaad, agpatingga met laeng iti carayan Jaboc, a beddeng dagiti annac ni Ammon;",
			"3": "<sup>3</sup> Ken ti Araba agingga iti baybay ti Cineret, nga agpadaya, ken inggana iti baybay ti Araba, a iti met laeng Baybay ti Asin, nga agpadaya, iti dalan nga agturong sadi Bet-jesimot; ken agpaabagatan; iti baba dagiti bacras ti Pisga:",
			"4": "<sup>4</sup> Ket ti beddeng ni Og nga ari ti Basan, a natda cadagiti Rafeos, a nagtaeng idiay Astarot ken idiay Edrei,",
			"5": "<sup>5</sup> Ket nagturay idiay bantay Hermon, ken idiay Salca, ken isu-amin a Basan, agingga iti beddeng dagiti Gesureo ken Maacateo, ken caguddua ti Galaad, a beddeng ni Sehon nga ari ti Hesbon.",
			"6": "<sup>6</sup> Ni Moises nga adipen ni Jehova ken dagiti annac ti Israel kinabilda ida: ket ni Moises nga adipen ni Jehova intedna nga agpaay iti panagtagicua cadagiti Rubenitas, ken cadagiti Gaditas, ken iti caguddua ti caputotan ni Manases.",
			"7": "<sup>7</sup> Ket dagitoy isuda dagiti ar-ari ti daga a kinabil ni Josue ken dagiti annac ti Israel iti ballasiw ti Jordan iti agpalaud, manipud Baal-gad idiay lobong ti Libano agingga idiay bantay Halac, a sumang-at idiay Seir (ket ni Josue intedna cadagiti caputotan ti Israel nga agpaay iti panagtagicua cadacuada a cas mayannurot iti bingbingayda;",
			"8": "<sup>8</sup> Iti caturodan ken iti tanap, ken idiay Araba ken idiay bacbacras, ken idiay let-ang ken idiay Abagatan; ti Heteo, ti Amorreo, ti Cananeo, ti Ferezeo, ti Heveo, ken ti Jebuseo):",
			"9": "<sup>9</sup> Ti ari ti Jerico, maysa; ti ari ti Ai nga adda iti abay ti Bet-el, maysa;",
			"10": "<sup>10</sup> Ti ari ti Jerusalem, maysa; ti ari ti Hebron, maysa;",
			"11": "<sup>11</sup> Ti ari ti Jarmut, maysa; ti ari ti Laquis, maysa;",
			"12": "<sup>12</sup> Ti ari ti Eglon, maysa; ti ari ti Gezer, maysa;",
			"13": "<sup>13</sup> Ti ari ti Debir, maysa; ti ari ti Geder, maysa;",
			"14": "<sup>14</sup> Ti ari ti Horma, maysa; ti ari ti Bet-el, maysa;",
			"15": "<sup>15</sup> Ti ari ti Libna, maysa; ti ari ti Adullam, maysa;",
			"16": "<sup>16</sup> Ti ari ti Maceda, maysa; ti ari ti Beth-el, maysa;",
			"17": "<sup>17</sup> Ti ari ti Tappua, maysa; ti ari ti Hefer, maysa;",
			"18": "<sup>18</sup> Ti ari ti Afec, maysa; ti ari ti Lasaron, maysa;",
			"19": "<sup>19</sup> Ti ari ti Madon, maysa; ti ari ti Hazor, maysa;",
			"20": "<sup>20</sup> Ti ari ti Simron-meron, maysa; ti ari ti Acsaf, maysa;",
			"21": "<sup>21</sup> Ti ari ti Taanac, maysa; ti ari ti Meguido, maysa;",
			"22": "<sup>22</sup> Ti ari ti Cedes, maysa; ti ari ti Jocneam idiay Carmel, maysa;",
			"23": "<sup>23</sup> Ti ari ti Dor idiay pantoc ti Dor, maysa; ti ari ti Gentes idiay Gilgal, maysa;",
			"24": "<sup>24</sup> Ti ari ti Tirsa, maysa; amin dagitoy nga ar-ari tallopuloda ket maysa."
		},
		"13": {
			"1": "<sup>1</sup> Ita ni Josue lacayen, ket nacapuyen cadagiti adu a tawtawenna; ket ni Jehova kinunana kencuana, Sica lacaycan ket nacapuyca cadagiti adu a tawtawenmo, ket adu pay laeng ti nabati a daga a matagicua.",
			"2": "<sup>2</sup> Daytoy ti daga a matda pay: isu-amin a sacup dagiti Filisteos, ken isu-amin a sacup ti Geseos;",
			"3": "<sup>3</sup> Manipud iti Sihor, nga adda iti sango ti Egipto, nga agpaamianan met laeng agingga iti beddeng ti Accaron, isu a maibilang cadagiti Cananeos; dagiti lima nga ap-appo dagiti Filisteos; dagiti Gazeos, ken dagiti Asdodios, dagiti Ascalonitas, dagiti Geteos, ken dagiti Accaronitas, casta met dagiti Heveos,",
			"4": "<sup>4</sup> Iti abagatan; isu-amin a daga dagiti Cananeos, ken Mehara a cucua dagiti Sidonios, inggana iti Afec, agtungpal iti beddeng dagiti Amorreos;",
			"5": "<sup>5</sup> Ket iti daga dagiti Gibleos, ken isu-amin a Libano, nga agturong iti leleggacan ti init, manipud iti Baalgad nga adda iti arisadsad ti bantay Hermon inggana iti sercan ti Hamat;",
			"6": "<sup>6</sup> Isu-amin dagiti agnaed iti caturodan manipud Libano inggana iti Misrefot-mayim, amin met laeng dagiti Sidonios; pasiaecto ida manipud iti saclang dagiti annac ti Israel: ipabagim laeng iti Israel a ipatawid, a cas imbilinco kenca.",
			"7": "<sup>7</sup> Gapuna itatta bingayem daytoy a daga a maipaay a tawid cadagi siam a caputotan ken iti caguddua ti caputotan ni Manases.",
			"8": "<sup>8</sup> Daydiay nairaman cadagiti Rubenitas ken dagiti Gaditas inawatdan ti tawidda, nga inted ni Moises cadacuada, idiay ballasiw ti Jordan nga agpadaya, cas pannangted cadacuada ni Moises nga adipen ni Jehova:",
			"9": "<sup>9</sup> Manipud Aroer, nga adda iti igid ti lobong ti Arnon, ken iti ili nga adda iti tengnga ti lobong, ken isu-amin a tanap ti medeba agingga iti Dibon;",
			"10": "<sup>10</sup> Ken isu-amin dagiti il-ili ni Sehon nga ari dagiti Amorreos, a nagari idiay Hesbon, inggana iti beddeng dagiti annac ni Ammon;",
			"11": "<sup>11</sup> Ken ti Galaad, ken iti nagpatinggaan dagiti Gesureos ken Maacateos, ken isu-amin a bantay Hermon, ken isu-amin a Basan inggana iti Salca;",
			"12": "<sup>12</sup> Isu-amin a pagarian ni Og idiay Basan a nagari idiay Astarot ken Edrei (daydi met laeng nabati cadagiti Rafeos); ta dagitoy kinabil ni Moises ket pinagtalaona ida.",
			"13": "<sup>13</sup> Nupay casta dagiti annac ti Israel saanda a pinagtalao dagiti Gesureos ken Maacateos; no di ket ti Gesureos ken Maaoat agnaedda iti tengnga ti Israel inggana ita nga aldaw.",
			"14": "<sup>14</sup> Iti laeng caputotan ni Levi ti saanna nga iniccan ti tawidna; dagiti datdaton a mapuuran iti apuy ken Jehova, a Dios ti Israel, isu ti tawidda, a cas kinunana kencuana.",
			"15": "<sup>15</sup> Ket ni Moises iniccanna ti caputotan dagiti annac ni Ruben iti cas mayannurot cadagiti famfamiliada.",
			"16": "<sup>16</sup> Ket ti beddengda isu idi manipud Aroer, nga adda iti igid ti lobong ti Arnon, ken iti ili nga adda iti tengnga ti lobong, ken isu-amin a tanap ti Medeba;",
			"17": "<sup>17</sup> Ti Hesbon, ken isu-amin dagiti il-ili nga addada iti tanap; ti Dibon, ken ti Bamot-baal, ken ti Bet-baalmeon,",
			"18": "<sup>18</sup> Ken ti Jaas, ken ti Keddemot, ken ti Mefaat,",
			"19": "<sup>19</sup> Ken ti Kiryataim, ken ti Sibma, ken ti Saratasar idiay bantay ti lobong,",
			"20": "<sup>20</sup> Ken ti Bet-peor, ken dagiti bacbacras ti Pisga, ken ti Bet-jesimot,",
			"21": "<sup>21</sup> Ken isu-amin dagiti il-ili ti tanap, ken amin a pagarian ni Sehon nga ari dagiti Amorrheos, a nagari idiay Hesbon isu a kinabil ni Moises agraman cadagiti panguloen ti Madian, Hevi, ken Recem, ken Sur, ken Hur, ken Reba, a pangpangolo ni Sehon, a nagtaeng idiay a daga.",
			"22": "<sup>22</sup> Casta met ni Balaam, a mammadles, ti anac a lalaki ni Beor, pinatay dagiti annac ti Israel iti campilan iti tengnga dagiti dadduma a pinatayda.",
			"23": "<sup>23</sup> Ket ti beddeng dagiti annac ni Ruben isu idi ti Jordan, ken ti beddengna. Daytoy isu idi ti tawid dagiti annac ni Ruben a cas mayalubog cadagiti famfamiliada, dagiti il-ili ken dagiti purpurocda.",
			"24": "<sup>24</sup> Ket ni Moises iniccanna ti caputotan ni Gad, dagiti annac ni Gad, a cas mayalubog cadagiti famfamiliada.",
			"25": "<sup>25</sup> Ket ti beddengda isu idi ti Jazer, ken isu-amin dagiti il-ili ti Galaad, ken caguddua ti daga dagiti annac ni Ammon, inggana iti Aroer nga adda iti sango ti Rabba;",
			"26": "<sup>26</sup> Ket manipud iti Hesbon inggana iti Ramotmizpa, ken Betonim; ken manipud Mahanaim inggana iti beddeng ti Debir.",
			"27": "<sup>27</sup> Ken idiay lobong ti Bet-aram, ken ti Beth-nimra, ken ti Socot, ken ti Safon, a natda iti pagarian ni Sehon nga ari ti Hesbon, ti Jordan ken iti beddengna, inggana iti caadayuan a paset ti baybay a Cineret iti ballasiw a daya ti Jordan.",
			"28": "<sup>28</sup> Daytoy isu ti tawid dagiti annac ni Gad cas mayalubog cadagiti famfamiliada, dagiti il-ili ken purpurocna.",
			"29": "<sup>29</sup> Ket ni Moises inyawatna ti tawid iti caguddua ti caputotan ni Manases: ket isu daydi ti maipaay iti caguddua ti caputotan dagiti annac ni Manases a cas mayalubog cadagiti famfamiliada.",
			"30": "<sup>30</sup> Ket ti beddengda isu idi manipud iti Mahanaim, isu-amin a Basan, isu-amin a pagarian ni Og nga ari ti Basan, ken isu-amin dagiti il-ili ti Jair, nga addada idiay Basan innem a pulo nga il-ili:",
			"31": "<sup>31</sup> Ken ti caguddua ti Galaad, ken Astarot, ken Adrei, dagiti il-ili ti pagarian ni Og idiay Basan, agpaayda cadagiti annac ni Maquir nga anac a lalaki ni Manases, agpaay met laeng iti caguddua dagiti annac ni Maquir a cas mayalubog cadagiti famfamiliada.",
			"32": "<sup>32</sup> Dagitoy isuda dagiti tawtawid cadagidiay tantanap ti Moab, nga imbunong ni Moises, iti ballasiw ti Jordan idiay dayaen ti Jerico.",
			"33": "<sup>33</sup> Ngem ni Moises awan ti intedna a tawid iti caputotan ni Levi: ni Jehova, a Dios ti Israel, isu ti tawidda, a cas sinaona cadacuada."
		},
		"14": {
			"1": "<sup>1</sup> Ket dagitoy isuda dagiti tawtawid nga innala dagiti annac ti Israel idiay daga ti Canaan, isuda a ni Eleazar a padi ken ni Josue nga anac ni Nun, ken dagiti panguloen dagiti balbalay dagiti amma dagiti caputotan dagiti annac ti Israel, inwarasda cadacuada,",
			"2": "<sup>2</sup> Babaen iti gasatda a ti tawid, cas ni Jehova imbilinna a naaramat ni Moises, a maipaay iti siam a caputotan, ken maipaay iti caguddua ti caputotan.",
			"3": "<sup>3</sup> Ta ni Moises intedna ti tawid dagiti dua a caputotan ken iti caguddua ti caputotan idiay ballasiw ti Jordan: ngem cadagiti Levitas saanna nga iniccan ida ti tawidda iti tengngada.",
			"4": "<sup>4</sup> Ta dagiti annac ni Jose nagcadduada a caputotan, ni Manases ken ni Efraim: ket isuda saanda a nangted iti bingay cadagiti Levitas idiay a daga, no saan laeng a dagiti il-ili a pagnaedanda, agraman palpalasotda nga agpaay cadagiti an-animalda ken agpaay iti pagtaraonda.",
			"5": "<sup>5</sup> Cas ni Jehova imbilinna ken Moises, casta ti inaramid dagiti annac ti Israel; ket biningayda ti daga.",
			"6": "<sup>6</sup> Idin dagiti annac ni Juda dimmanonda ken Josue idiay Gilgal; ket ni Caleb nga anac a lalaki ni Jefone a Cenezeo kinunana kencuana, Sica ammom ti panggep a ni Jehova sinaona ken Moises a tao ti Dios a maipapan caniac ken maipanggep kenca idiay Cades-barnea.",
			"7": "<sup>7</sup> Uppat a pulo dagiti tawenco idi a ni Moises nga adipen ni Jehova imbaonnac nanipud sadi Cades-barnea tapno siimec ti daga; ket inyegco manen kencuana ti sao cas adda idi iti pusoc.",
			"8": "<sup>8</sup> Nupay casta dagiti cacabsatco a nakipagsang-at caniac pinagrunawda ti puso dagiti tattao; ngem siac sinurotco a naimbag ni Jehova a Diosco.",
			"9": "<sup>9</sup> Ket ni Moises nagsapata iti daydi nga aldaw, a cunana, Pudno unay nga iti daga a nabaddecan ta sacam agnanayonto a tawidmo ken cadagiti annacmo, agsipud ta sinurotmo a naimbag ni Jehova a Diosmo.",
			"10": "<sup>10</sup> Ket ita, adtoy, kitaem, ni Jehova inaywanannac a sibibiag, a cas sinaona, dagitoy uppat a pulo ket lima a tawen, nanipud idi tiempo a ni Jehova insaona daytoy a sao ken Moises, iti bayat a pinagpagpagna ti Israel iti let-ang, ket ita, adtoy, daytoy nga aldaw walopuloda ket lima dagiti tawenco.",
			"11": "<sup>11</sup> Nupay casta napigsaac pay laeng ita nga aldaw a cas iti capigsac idi aldaw a ni Moises imbaonnac: no casano ti pigsac idi casta met laeng ti pigsac ita, agpaay iti gubat man, ken iti iruruar man ken iti iseserrec man.",
			"12": "<sup>12</sup> Ita ngarud itedmo caniac daytoy a caturodan, isu a ni Jehova insaona iti daydi nga aldaw; ta sica nangegmo iti daydi nga aldaw no casano ti caadda dagidi Anaceos idiay, ken dagiti il-ili a dadackel ken nasarikedkedan: mabalin a ni Jehova addanto caniac, ket pagtalaoecto ida, a cas imbaga ni Jehova.",
			"13": "<sup>13</sup> Ket ni Josue binendicionanna ni Caleb, anac a lalaki ni Jefone; ket intedna a tawidenna ti Hebron.",
			"14": "<sup>14</sup> Gapuna a ti Hebron nagbalin a tawid ni Caleb nga anac a lalaki ni Jefone a Cenezeo inggana ita nga aldaw; agsipud ta isu sinurotna a naimbag ni Jehova a Dios ti Israel.",
			"15": "<sup>15</sup> Ti nagan ti Hebron idi casacbayan daytoy a tiempo isu idi ti Kiryat-arba; ni Arba nga isu idi ti catan-ocan a tao cadagiti Enaceos. Ket ti daga naginana iti gubat."
		},
		"15": {
			"1": "<sup>1</sup> Ket ti gasat nga agpaay iti caputotan dagiti annac ni Juda a cas mayalubog cadagiti famfamiliada isu idi ti agpatingga iti beddeng ti Edom, ti met laeng let-ang ti Zin iti abagatan, iti caadayuan a paset ti abagatan.",
			"2": "<sup>2</sup> Ket ti beddengda iti abagatan isu idi ti manipud iti caadayuan a paset ti Baybay ti Asin, manipud iti sucucna nga agpaabagatan;",
			"3": "<sup>3</sup> Ket rimmuar nga agpaabagatan iti sang-atan ti Acrabim, ket nagtuloy agingga iti Zin, ket simmangat iti abagatan ti Cades-barnea ket nagtuloy iti Jesron, ket simmang-at aginggana iti Addar, ket agsicco agingga iti Carca;",
			"4": "<sup>4</sup> Ket nagtuloy agingga iti Azmon, ket rimmuar iti waig ti Egipto; ket dagiti pagruaran daytoy a beddeng addada iti taaw: daytoy isunto ti nakinabagatan a beddengyo.",
			"5": "<sup>5</sup> Ket ti nakin-daya a beddeng isu ti Baybay ti Asin, inggana met laeng iti pungto ti Jordan. Ket ti beddeng ti nakinamianan a bangir isu idi ti manipud iti sucuc ti baybay nga adda iti pungto ti Jordan;",
			"6": "<sup>6</sup> Ket ti beddeng simmang-at inggana iti Bet-hogla, ket nagtuloy iti amianan agingga iti Bet-araba; ken ti beddeng simmang-at iti bato ni Bohan nga anac a lalaki ni Ruben;",
			"7": "<sup>7</sup> Ket ti beddeng simmang-at agingga iti Dabir manipud iti lobong ti Acor ket iti casta nagpaamianan, a pumerreng iti Gilgal, nga adda iti sango ti sang-atan ti Adumin, nga adda iti akinabagatan a bangir ti carayan; ket ti beddeng naglayon cadagiti dandanum ti En-semes, ket dagiti pagruaran daytoy adda idi iti Enrogel;",
			"8": "<sup>8</sup> Ket ti beddeng simmang-at iti lobong ti anac a lalaki ni Hinnom inggana iti abay nga abagatan ti Jebuseo (nga isu met laeng ti Jerusalem); ket ti beddeng simmang-at agingga iti tapaw ti bantay nga adda iti sango ti lobong ti Hinnom iti laud, isu nga adda iti caadayuan a paset ti lobong ti Rafaim iti agpaamianan;",
			"9": "<sup>9</sup> Ket ti beddeng naglayon nanipud iti tapaw ti bantay agingga iti ubbog dagiti dandanum ti Neftoa, ket timpuar agingga cadagiti il-ili ti bantay Epfron; ket ti beddeng naglayon agingga iti Baala (nga isu met laeng ti Kiryat-jearim):",
			"10": "<sup>10</sup> Ket ti beddeng nagsicco nanipud iti Baala iti laud inggana iti bantay Seir, ket naglayon agingga iti bacras ti bantay Jearim iti amianan (nga isu met laeng ti Kesalon), ket nagsalog agingga iti Bet-semes ket naglayon iti Timna;",
			"11": "<sup>11</sup> Ket ti beddeng rimmuar iti abay ti Ecron nga agpaamianan; ket ti beddeng naglayon iti Sicron, ket naglayon iti bantay Baala, ket rimmuar idiay Jabneel; ket dagiti pagruaran ti beddeng addada idiay taaw.",
			"12": "<sup>12</sup> Ket ti akin-laud a beddeng isu idi ti agingga iti taaw a dackel ken ti igidna. Daytoy isu ti beddeng dagiti annac ni Juda a cas mayannurot cadagiti famfamiliada.",
			"13": "<sup>13</sup> Ket isu iniccanna ni Caleb nga anac a lalaki ni Jefone iti maysa nga apag cadagiti annac ni Juda, a cas mayannurot iti bilin ni Jehova ken Josue, iti met laeng Kiryat-arba, ni Arba nga isu idi ti ama ni Enac (nga isu met laeng ti Hebron).",
			"14": "<sup>14</sup> Ket ni Caleb pinasiana idiay dagiti tallo nga annac a lallaki ni Enac; da Sesai, Aiman, ken Talmai, nga annac ni Enac.",
			"15": "<sup>15</sup> Ket nanipud sadiay simmang-at a maibusor cadagiti agnaed idiay Debir: ti Kiryat-sefer isu ti nagan ti Debir idi unana a tiempo.",
			"16": "<sup>16</sup> Ket ni Caleb kinunana, Daydiay a mangcabil iti Kiryat-sefer, ket isu alaenna, isu ti pangyasawacto ken anacco nga Acsa.",
			"17": "<sup>17</sup> Ket ni Otoniel nga anac a lalaki ni Cenez, a cabsat a lalaki ni Caleb isu innalana: ket isu inyasawana kencuana ni Acsa nga anacna.",
			"18": "<sup>18</sup> Ket naaramid, nga idi a ni Acsa immay ken Otoniel, tinignayna ni Otoniel a dumawat ken amana iti maysa a talon: ket ni Acsa dimsaag idi asnona; ket ni Acsa dimsaag idi asnona; ket ni Caleb kinunana kencuana, Ania ti cayatmo?",
			"19": "<sup>19</sup> Ket kinunana, Iccannac ti bendicion; ta sica insaadnac iti daga ti abagatan, iccannac met cadagiti ub-ubbog ti danum. Ket isu intedna dagiti nakinngato ken nakinbaba nga ub-ubbog.",
			"20": "<sup>20</sup> Daytoy isu ti tawid ti caputotan dagiti annac ni Juda a cas mayannurot cadagiti famfamiliada.",
			"21": "<sup>21</sup> Ket dagiti caadayuan nga il-ili ti caputotan dagiti annac ni Juda nga agturong iti beddeng ti Edom idiay abagatan isuda Cabseel, ken Eder, ken Jagur,",
			"22": "<sup>22</sup> Ken Cina, ken Dimona, ken Adada,",
			"23": "<sup>23</sup> Ken Cedes, ken Asor, ken Itnan,",
			"24": "<sup>24</sup> Zif, ken Telem, ken Bealot,",
			"25": "<sup>25</sup> Ken Asor-hadatta, ken Keriyathesron, (nga isu met laeng ti Asor),",
			"26": "<sup>26</sup> Amam, ken Sema, ken Molada,",
			"27": "<sup>27</sup> Ken Asar-gadda, ken Hesmon, Bet-pelet,",
			"28": "<sup>28</sup> Ken Hasar-sual, Beerseba, ken Bizotia,",
			"29": "<sup>29</sup> Baala, ken Iyim, ken Esem,",
			"30": "<sup>30</sup> Ken Eltolad, ken Cesil, ken Horma,",
			"31": "<sup>31</sup> Ken Siclag, ken Madmanna, Sansana,",
			"32": "<sup>32</sup> Ken Lebaot, Silim, ken Ayin, ken Rimmon; dagup amin dagiti il-ili duapuloda ket siam, agraman dagiti purpurocda.",
			"33": "<sup>33</sup> Iti tanap, Estaol, ken Sorea, ken Asena,",
			"34": "<sup>34</sup> Ken Zanoe, ken Engannim, Tappua, ken Enam,",
			"35": "<sup>35</sup> Jarmut, ken Adullam, Soco, ken Aceca,",
			"36": "<sup>36</sup> Ken Saraim, ken Adithaim, ken Gedera, ken Gederotaim; sangapulo ket uppat nga il-ili agraman purpurocda.",
			"37": "<sup>37</sup> Senan, ken Hadasa, ken Migdalgad,",
			"38": "<sup>38</sup> Ken Dilan, ken Mizpa, ken Jocteel,",
			"39": "<sup>39</sup> Ken Laquis, ken Boscath, ken Eglon,",
			"40": "<sup>40</sup> Ken Cabon, ken Lamas, ken Kitlis,",
			"41": "<sup>41</sup> Ken Gederot, Bet-dagon, ken Naama, ken Maceda; sangapulo ket innem nga il-ili agraman purpurocda.",
			"42": "<sup>42</sup> Libna, ken Eter, ken Asan,",
			"43": "<sup>43</sup> Ken Jifta, ken Asena, ken Nesib,",
			"44": "<sup>44</sup> Ken Ceila, ken Aczib, ken Maresa; siam nga il-ili agraman purpurocda.",
			"45": "<sup>45</sup> Ecron agraman dagiti il-ili na ken purpurocna;",
			"46": "<sup>46</sup> Manipud Ecron agingga iti taaw met laeng, isu-amin nga adda iti abay ti Asdod, agraman ti purpurocda.",
			"47": "<sup>47</sup> Ti Asdod, dagiti il-ilina ken dagiti purpurocna; Gaza, dagiti il-ilina ken dagiti purpurocna; inggana iti waig ti Egipto ken iti dackel a taaw, ken ti beddengna.",
			"48": "<sup>48</sup> Ket iti caturodan, Samir, ken Jattir, ken Succot,",
			"49": "<sup>49</sup> Ken Danna, ken Kiryat-sana (nga isu met laeng ti Debir),",
			"50": "<sup>50</sup> Ken Anab, ken Estemo, ken Anim,",
			"51": "<sup>51</sup> Ken Gosen, ken Olon, ken Gilo; sangapulo ket maysa nga il-ili agraman purpurocda.",
			"52": "<sup>52</sup> Arab, ken Duma, ken Esan,",
			"53": "<sup>53</sup> Ken Janum, ken Bet-tappua, ken Afeca,",
			"54": "<sup>54</sup> Ken Humta, ken Kiryat-arba, (nga isu met laeng ti Hebron), ken Sior; siam nga il-ili agraman purpurocda.",
			"55": "<sup>55</sup> Maon, Carmel, ken Zif, ken Juta,",
			"56": "<sup>56</sup> Ken Zezrael, Jocdeam, ken Zanoa,",
			"57": "<sup>57</sup> Cain, Gibeo, ken Timma; sangapulo nga il-ili agraman purpurocda.",
			"58": "<sup>58</sup> Halhul, ken Bet-sur, ken Gedor,",
			"59": "<sup>59</sup> Ken Meara, ken Bet-anot, ken Eltecon; innem nga il-ili agraman purpurocda.",
			"60": "<sup>60</sup> Kiryat-baal, (nga isu met laeng ti Chiriath-jearim), ken ti Rabba; dua nga il-ili agraman purpurocda.",
			"61": "<sup>61</sup> Idiay let-ang, Ber-araba, Middin ken Secacha,",
			"62": "<sup>62</sup> Ken Nibsan, ken ti Ili ti Asin, ken Engedi; innem nga il-ili agraman purpurocda.",
			"63": "<sup>63</sup> Ket no maipapan cadagiti Jebuseos, a nagnaed iti Jerusalem, dagiti annac ni Juda dida nabalin a pinagtalao ida no di ket ti Jebuseo nakipagnaed cadagiti annac ni Juda idiay Jerusalem inggana itoy nga aldaw."
		},
		"16": {
			"1": "<sup>1</sup> Ket ti gasat rimmuar nga agpaay cadagiti annac ni Jose nanipud iti Jordan idiay Jerico, cadagiti dandanum ti Jerico iti daya, iti met laeng let-ang, sumang-at manipud Jerico iti caturodan agingga iti Bet-el;",
			"2": "<sup>2</sup> Ket manipud Bet-el rimmuar inggana iti Luz, ket naglayon inggana iti beddeng dagiti Arquitas inggana iti Atarot;",
			"3": "<sup>3</sup> Ket nagsalog a nagpalaud inggana iti beddeng dagiti Jaflateos, agingga iti beddeng ti Beth-horon a nakinbaba, agingga met laeng iti Gezer; ket dagiti pagruaranna addada idi iti taaw.",
			"4": "<sup>4</sup> Ket dagiti annac ni Jose, da Manases ken Efraim innalada ti tawidda.",
			"5": "<sup>5</sup> Ti beddeng dagiti annac ni Efraim a cas mayannurot cadagiti famfamiliada isu daytoy: ti beddeng ti tawidda nga agpadaya isu idi ti manipud Atarot-addar agingga iti Bet-horon a nakinngato;",
			"6": "<sup>6</sup> Ket ti beddeng rimmuar a nagpalaud idiay Micmetat iti amianan; ket ti beddeng nagsicco a nagpadaya inggana iti Tanat-silo, ket naglayon iti daya ti Janoa;",
			"7": "<sup>7</sup> Ket simmalog nanipud Janoa inggana iti Ataroth, ken inggana iti Naarat, ket gimmawat agingga iti Jerico, ket rimmuar iti Jordan.",
			"8": "<sup>8</sup> Manipud Tappua ti beddeng naglayon a nagpalaud agingga iti waig ti Cana; ket dagiti pagruaranna addada idi iti taaw. Daytoy isu ti tawid ti caputotan dagiti annac ni Efraim a mayannurot cadagiti famfamiliada;",
			"9": "<sup>9</sup> Naitipon cadagiti il-ili a nailasin nga agpaay cadagiti annac ni Efraim iti tengnga ti tawid dagiti annac ni Manases, isu-amin dagiti il-ili agraman purpurocda.",
			"10": "<sup>10</sup> Ket isuda saanda a pinagtalao dagiti Cananeo a nagnaed idiay Gezer: no di ket dagiti Cananeo agnaedda iti tengnga ti Efraim agingga ita nga aldaw, ket nagbalinda nga adipen nga agaramid cadagiti narigat nga aramid."
		},
		"17": {
			"1": "<sup>1</sup> Ket daytoy isu ti gasat nga agpaay cadagiti caputotan ni Manases: ta isu ti inauna nga anac ni Jose. Ta ni Maquir nga anac nga inauna ni Manases, nga ama ni Galaad; agsipud ta isu maysa a tao ti gubgubat, gapuna nga isu icutanna ti Galaad ken Basan.",
			"2": "<sup>2</sup> Iti casta ti gasat nga agpaay cadagiti dadduma nga annac ni Manases a cas mayannurot cadagiti famfamiliada: nagpaay cadagiti annac ni Abiezer, ken cadagiti annac ni Helec, ken cadagiti annac ni Esriel, ken cadagiti annac ni Siquiem, ken cadagiti annac ni Hefer, ken cadagiti annac ni Semida: dagitoy isuda dagidi annac a lallaki ni Manases nga anac ni Jose a cas mayannurot cadagiti famfamiliada.",
			"3": "<sup>3</sup> Ngem ni Zelofehad, nga anac a lalaki ni Hefer, nga anac a lalaki ni Galaad, nga anac a lalaki ni Maquir, nga anac a lalaki ni Manases, awan idi ti annacna a lallaki, no di laeng babbai: ket dagitoy ti nagnagan dagiti annacna a babbai: Maala, Noa, Hogla, Milca, ken Tirsa.",
			"4": "<sup>4</sup> Ket isuda immadanida iti saclang ni Eleazar a padi, ken iti saclang ni Josue nga anac ni Nun, ken iti saclang dagiti pangpangoloen, a kinunada, Ni Jehova imbilinna ken Moises nga iccannacami iti maysa a tawid iti tengnga dagiti cacabsatmi: gapuna cas mayannurot iti bilin ni Jehova isu iniccanna ida iti maysa a tawid iti tengnga dagiti cacabsat ni amada.",
			"5": "<sup>5</sup> Ket sangapulo a capaset ti naipagasat ken ni Manases, sabali laeng ti daga ti Galaad ken Basan, nga adda iti ballasiw ti Jordan;",
			"6": "<sup>6</sup> Gapu ta dagiti babbai nga annac ni Manases addaanda met iti maysa a tawid iti tengnga dagiti annacna a lallaki. Ket ti daga a Galaad cucua idi dagiti natda cadagiti annac a lallaki ni Manases.",
			"7": "<sup>7</sup> Ket ti beddeng ni Manases isu idi ti manipud Aser agingga iti Micmetat, nga adda iti sangoanan ti Siquim; ket ti beddeng naglayon iti macanawan inggana cadagiti agnaed ti Tappua.",
			"8": "<sup>8</sup> Ti daga ti Tappua naipatagicua idi ken ni Manases; ngem ti Tappua nga adda iti igid ti sacup ni Manases naipatagicua cadagiti annac ni Efraim.",
			"9": "<sup>9</sup> Ket ti beddeng simmalog agingga iti waig ti Cana, iti abagatan ti waig; dagitoy nga il-ili naipatagicuada ken ni Efraim iti tengnga dagiti il-ili ni Manases: ket ti beddeng ni Manases adda iti makinamianan nga abay ti waig, ket dagiti pagruaranna addada iti taaw:",
			"10": "<sup>10</sup> Iti agpaabagatan isu ti cucua ni Efraim, ket ti agpaamianan cucua ni Manases, ket ti taaw isu ti beddengna, ket isuda gimmawatda agingga iti Aser iti amianan, ken agingga iti Issacar iti daya.",
			"11": "<sup>11</sup> Ket ni Manases adda cucuana idiay Issacar, ken idiay Aser ti Bet-sean ken dagiti il-ilina, ken Ibleam ken dagiti il-ilina, ken dagiti agnaed idiay Dor ken dagiti il-ilina, ken dagiti agnaed idiay Endor ken dagiti il-ilina, dagiti agnaed idiay Taanac ken il-ilina ken dagiti agnaed idiay Megiddo ken dagiti il-ilina, a tallo met laeng a panpantoc.",
			"12": "<sup>12</sup> Nupay casta dagiti annac ni Manases saanda a nabalin a pinagtalao dagiti agnaed cadagidiay nga il-ili; no di ket dagiti Cananeo kinayatda ti nagnaed idiay a daga.",
			"13": "<sup>13</sup> Ket naaramid, nga idi a dagiti annac ti Israel pimmigsada, insaadda iti panagtrabajo dagiti Cananeo, ket saanda a pinagtalao ida nga intalipupus.",
			"14": "<sup>14</sup> Ket dagiti annac ni Jose nagsaoda ken Josue, a kinunada, Apayapay a sica iniccannacami iti maymaysa a gasat laeng ken maymaysa a cadasig a tawid, idinto ta siac dackelac nga ili, ta inggana ita nga tiempo ni Jehova binendicionannac?",
			"15": "<sup>15</sup> Ket ni Josue kinunana cadacuada, No sica dackelca nga ili, gumon-odca idiay cabakiran, ken umaenyo nga agpaay cadacayo idiay daga dagiti Perezeo ken dagiti Rafaim; no cas ti caturodan ti Efraim nailet unay kenca.",
			"16": "<sup>16</sup> Ket dagiti annac ni Jose kinunada, Ti caturodan saan a macaanay cadacami: ket isu-amin dagiti Cananeos nga agnaed idiay daga ti lobong adda lugluganda a linandocan, agpapadada cadagidiay agnaed idiay Bet-sean ken dagiti il-ilina, ken dagiti adda idiay lobong ti Jezreel.",
			"17": "<sup>17</sup> Ket ni Josue nagsao iti balay ni Jose, nga iti met laeng Efraim ken Manases, ket kinunana, Sica dackelca nga ili, ken icutam ti dackel a cabaelan; saanto a maymaysa laeng ti gasatmo:",
			"18": "<sup>18</sup> No di ket ti caturodan isunto ti cucuam; ta uray no cabakiran, umaemto, ket dagiti pagruaranna cucuamto; ta pagtalaoemto dagiti Cananeo, nupay no isuda adda lugluganda a linandocan, ken nupay no isuda napigsada."
		},
		"18": {
			"1": "<sup>1</sup> Ket isu-amin a gimong dagiti annac ti Israel naguornongda idiay Silo, ket namangonda iti maysa a tolda ti gimong idiay: ket ti daga naparucma iti sangoda.",
			"2": "<sup>2</sup> Ket natda cadagiti annac ti Israel dagiti pito a capcaputotan, isuda a dida pay biningay ti tawidda.",
			"3": "<sup>3</sup> Ket ni Josue kinunana cadagiti annac ti Israel, Casano ti cabayagyo a di mangicascaso iti ipapanyo a mangtagicua iti daga a ni Jehova a Dios dagiti ammayo intedna cadacayo?",
			"4": "<sup>4</sup> Mangtudingcayo cadacayo met laeng iti tallo a tattao iti tunggal maysa a caputotan: ket ibaonconto ida, ket isuda tumacderdanto, ket pagnaendanto ti daga, ket isuda mapaendanto a cas mayannurot iti tawidda; ket isuda umaydanto caniac.",
			"5": "<sup>5</sup> Ket isuda bingayendanto ti daga iti agcapito capaset: ni Juda agnaedto iti beddengna iti abagatan, ket ti balay ni Jose agnaedto iti beddengda iti amianan.",
			"6": "<sup>6</sup> Ket dacayo mapaenyonto ti daga iti agcapito capaset, ket yegyonto caniac ditoy ti nacamapaanna; ket paggiginnasanggasatecto cadacayo iti saclang ni Jehova a Diostayo.",
			"7": "<sup>7</sup> Ta dagiti Levitas awan ti bingayda cadacayo: ta ti kinapadida ken Jehova isu ti tawidda: ket ni Gad ken ni Ruben, ken ti caguddua ti caputotan ni Manases inawatdan ti tawidda iti ballasiw ti Jordan nga agpadaya, isu a ni Moises nga adipen ni Jehova intedna cadacuada.",
			"8": "<sup>8</sup> Ket dagiti tattao timmacderda, ket napanda: ket ni Josue incumitna cadagiti napan a mangmapa iti daga, a kinunana, Incayo ket pagnaenyo ti daga, ket isu mapaenyo, ket umaycayonto manen caniac; ket siac paggiginnasanggasatecto cadacayo iti saclang ni Jehova ditoy Silo.",
			"9": "<sup>9</sup> Ket dagiti tattao napanda ket pinagnada amin a daga, ket mapada iti inilin-ili iti nagcapito capaset iti maysa a libro; ket isuda immayda ken Josue idiay pacarso sadi Silo.",
			"10": "<sup>10</sup> Ket ni Josue pinaggiginnasatna cadacuada idiay Silo iti saclang ni Jehova: ket ni Josue biningbingayna idiay ti daga cadagiti annac ti Israel a cas mayannurot cadagiti bingbingayda.",
			"11": "<sup>11</sup> Ket ti gasat dagiti annac ni Benjamin rimmuar a cas mayannurot cadagiti famfamiliada: ket ti beddeng ti gasatda rimmuar iti nagbaetan dagiti annac ni Juda ken dagiti annac ni Jose.",
			"12": "<sup>12</sup> Ket ti beddengda iti deppaarna iti amianan isu idi ti manipud iti Jordan; ket ti beddeng simmang-at iti abay ti Jerico iti amianan, ket simmang-at iti caturodan nga agpalaud; ket dagiti pagruaranna addada idi iti let-ang ti Beth-aven.",
			"13": "<sup>13</sup> Ket ti beddeng naglayon manipud idiay agingga iti Luz, iti abay ti Luz (nga isu met laeng ti Bet-el), iti agpaabagatan, ket ti beddeng nagsalog inggana iti Atarot-addar, iti denna ti bantay nga adda iti abagatan ti Bet-horon nga akinbaba.",
			"14": "<sup>14</sup> Ket ti beddeng naglayon manipud idiay, ket nagsicco iti bangirna ti laud nga agpaabagatan, manipud iti bantay nga adda iti sangoanan ti Beth-oron nga agpaabagatan; ket dagiti pagruaranna addada idi idiay Kiryat-baal (nga isu met laeng ti Kiryat-jearim), a maysa nga ili dagiti annac ni Juda: daytoy isu ti bangirna iti laud.",
			"15": "<sup>15</sup> Ket ti bangirna iti abagatan manipud iti caadayuan a paset ti Kiryat-jearim; ket ti beddeng rimmuar a nagpalaud, ket rimmuar a nagturong iti ubbog dagiti dandanum ti Neftoa;",
			"16": "<sup>16</sup> Ket ti beddeng nagsalog inggana iti caadayuan a paset ti bantay nga adda iti sango ti tanap ti anac a lalaki ni Hinnom, nga adda iti lobong ni Rafaim iti amianan; ket nagsalog agingga iti lobong ni Hinnom, agingga iti sikigan ti Jebuseo nga agpaabagatan, ket nagsalog agingga iti En-rogel.",
			"17": "<sup>17</sup> Ket naglayon a nagpaamianan, ket rimmuar idiay Ensemes, ket rimmuar idiay Gelilot nga adda iti sangoanan ti sang-atan ti Adummim; ket nagsalog agingga iti bato ni Bohan nga anac a lalaki ni Ruben;",
			"18": "<sup>18</sup> Ket naglayon a nagpaamianan agingga iti sikigan a pumerreng iti Araba, ket nagsalog agingga iti Araba;",
			"19": "<sup>19</sup> Ket ti beddeng naglayon agingga iti sikigan ti Beth-hogla nga agpaamianan; ket dagiti pagruaran ti beddeng addada idi idiay nakinamianan a sucuc ti Baybay ti Asin idiay nakinabagatan a pungto ti Jordan: daytoy isu ti nakinabagatan a beddeng.",
			"20": "<sup>20</sup> Ket ti Jordan isu idi ti beddengna iti bangirna iti daya. Daytoy isu ti tawid dagiti annac ni Benjamin, cadagiti bedbeddeng nga aglicmut, a cas mayannurot cadagiti famfamiliada.",
			"21": "<sup>21</sup> Ita dagiti il-ili ti caputotan dagiti annac ni Benjamin a cas mayannurot cadagiti famfamiliada isuda ti Jerico, ken Bet-hogla, ken Casis.",
			"22": "<sup>22</sup> Ken Bet-araba, ken Sumaraim, ken Bet-el,",
			"23": "<sup>23</sup> Ken Avim, ken Para, ken Ofra,",
			"24": "<sup>24</sup> Ken Kefar-haammoni, ken Ofni, ken Gaba: sangapulo ket dua nga il-ili agraman purpurocda:",
			"25": "<sup>25</sup> Gabaon, ken Rama, ken Beerot,",
			"26": "<sup>26</sup> Ken Mizpa, ken Cefira, ken Moza,",
			"27": "<sup>27</sup> Ken Recom, ken Irpeel, ken Tarala,",
			"28": "<sup>28</sup> Ken Sela, ken Elef, ken Jebus (nga isu met laeng ti Jerusalem), Gibeat, ken Kiryat; sangapulo ket uppat nga il-ili agraman purpurocda. Daytoy ti tawid dagiti annac ni Benjamin a cas mayannurot cadagiti famfamiliada."
		},
		"19": {
			"1": "<sup>1</sup> Ket ti maicadua a gasat rimmuar ken Simeon, iti caputotan met laeng ni Simeon cas mayannurot cadagiti famfamiliada: ket ti tawidda adda idi iti nagbaetan ti tawid dagiti annac ni Juda.",
			"2": "<sup>2</sup> Ket nagun-odanda iti panagtawid, iti Beerseba, wenno Seba, ken Molada,",
			"3": "<sup>3</sup> Ken Hasar-sual, ken Bala, ken Esem,",
			"4": "<sup>4</sup> Ken Heltolad, ken Betul, ken Horma,",
			"5": "<sup>5</sup> Ken Siclag, ken Bet-marcabot, ken Hasarsusa,",
			"6": "<sup>6</sup> Ken Bet-lebat, ken Saruhen; sangapulo ket tallo nga il-ili agraman purpurocda:",
			"7": "<sup>7</sup> Ayin, Rimmon, ken Eter, ken Asan; uppat nga il-ili agraman purpurocda:",
			"8": "<sup>8</sup> Ken isu-amin dagiti purpuroc nga addada iti aglicmut cadagitoy nga il-ili inggana iti Baalat-beer, Ramat ti Abagatan. Daytoy isu ti tawid ti caputotan dagiti annac ni Simeon a cas mayannurot cadagiti famfamiliada.",
			"9": "<sup>9</sup> Nagtaud iti apag dagiti annac ni Juda isu idi ti tawid dagiti annac ni Simeon; agsipud ta ti apag dagiti annac ni Juda isu idi ti adu unay cadacuada: gapuna a dagiti annac ni Simeon adda idi tawidda iti nagtengngaan ti tawid dagidiay.",
			"10": "<sup>10</sup> Ket ti maicatlo a gasat rimmuar a maipaay cadagiti annac ni Zabulon a cas mayannurot cadagiti famfamiliada. Ket ti beddeng ti tawidda isu idi ti agingga iti Sarid;",
			"11": "<sup>11</sup> Ket ti beddengda simmang-at a nagpalaud, iti met laeng Marala, ket dimteng agingga iti Dabe-set; ket dimteng iti waig, nga adda iti sango ti Jocneam;",
			"12": "<sup>12</sup> Ket manipud Sarid nagsicco a nagpadaya nga agpaleleggacan ti init agingga iti beddeng ti Kislot-tabor; ket rimmuar iti Deberat, ket simmang-at iti Jafia;",
			"13": "<sup>13</sup> Ket manipud idiay naglayon a nagpadaya iti Gat-hefer, iti Ittakazin, ket rummuar idiay Rimmon a gumaw-at agingga iti Nea:",
			"14": "<sup>14</sup> Ket ti beddeng nagsicco idiay nga agpaamianan agingga iti Hanaton; ket dagiti pagruaranna addada idi idiay lobong ti Jefte-el;",
			"15": "<sup>15</sup> Ken Catat, ken Naalal, ken Simron, ket Ideala, ken Bet-lehem: sangapulo ket dua nga il-ili agraman purpurocda.",
			"16": "<sup>16</sup> Daytoy ti tawid dagiti annac ni Zabulon a cas mayannurot cadagiti famfamiliada, dagitoy nga il-ili agraman purpurocda.",
			"17": "<sup>17</sup> Ti maicapat a gasat rimmuar nga agpaay ken Isacar, cadagiti met laeng annac ni Isacar a mayannurot cadagiti famfamiliada.",
			"18": "<sup>18</sup> Ket ti beddengda isu idi ti agingga iti Jezreel, ken Kesulot, ken Sunem,",
			"19": "<sup>19</sup> Ken Hafaraim, ken Sion, ken Anaarat,",
			"20": "<sup>20</sup> Ken Rabbit, ken Cision, ken Ebes,",
			"21": "<sup>21</sup> Ken Ramet, ken Enganin, ken Enhadda, ken Bet-passes,",
			"22": "<sup>22</sup> Ket ti beddeng dimteng aginggana iti Tabor, ken Sahasim, ken Bet-semes; ket dagiti pagruaran ti beddengda addada idi idiay Jordan; sangapulo ket innem nga il-ili agraman purpurocda.",
			"23": "<sup>23</sup> Daytoy ti tawid ti caputotan dagiti annac ni Isacar a mayannurot cadagiti famfamiliada, dagiti il-ili agraman purpurocda.",
			"24": "<sup>24</sup> Ket ti maicalima a gasat rimmuar nga agpaay iti caputotan dagiti annac ni Aser a cas mayannurot cadagiti famfamiliada.",
			"25": "<sup>25</sup> Ket ti beddengda isu idi ti Helcat, ken Hali, ken Beten, ken Acsaf,",
			"26": "<sup>26</sup> Ken Alamelec, ken Amad, ken Misal: ket dimmanon agingga iti Carmel nga agpalaud, ken iti Sihorlibnat;",
			"27": "<sup>27</sup> Ket nagtuloy nga agturong iti leleggacan ti init nga agpa-Bet-dagon, ket dimmanon iti Zabulon, ken iti lobong ti Jefte-el, nga agpaamianan iti Bet-emec ken Naiel; ket rimmuar iti Cabul iti macatigid,",
			"28": "<sup>28</sup> Ken iti Hebron, ken Rehob, ken Hammon, ken Cana, agingga met laeng iti dackel a Sidon;",
			"29": "<sup>29</sup> Ket ti beddeng nagsicco agingga iti Horma, ken agingga iti nasarikedkedan nga ili ti Tiro; ket ti beddeng nagsicco agingga iti Hosa; ket dagiti pagruaranna addada idi idiay taaw iti sacup ti Aczib;",
			"30": "<sup>30</sup> Ken castamet ti Umma met, ken Afec, ken Rehob; duapulo ket dua nga il-ili agraman purpurocda.",
			"31": "<sup>31</sup> Daytoy ti tawid ti caputotan dagiti annac ni Aser a mayannurot cadagiti famfamiliada, dagitoy nga il-ili agraman purpurocda.",
			"32": "<sup>32</sup> Ti maicanem a gasat rimmuar idi nga agpaay cadagiti annac ni Neftali, cadagiti met laeng annac ni Neftali a cas mayannurot cadagiti famfamiliada.",
			"33": "<sup>33</sup> Ket ti beddengda isu idi ti manipud Helef, manipud iti lugo idiay Saanaim, ken Adami-neceb, ken Jebneel agingga iti Lacum; ket dagiti pagruaranna addada idi idiay Jordan;",
			"34": "<sup>34</sup> Ket ti beddeng nagsicco nga agpalaud iti Aznot-tabor, ket rimmuar manipud idiay agingga iti Hucuca; ket dimmanon agingga iti Zabulon iti abagatan, ket dimmanon iti Aser iti laud: ken iti Juda idiay Jordan nga agturong iti leleggacan ti init.",
			"35": "<sup>35</sup> Ket dagiti il-ili a nasarikedkedan isuda Siddim, Ser, ken Hamath, Raccat, ken Cineret,",
			"36": "<sup>36</sup> Ken Adama, ken Rama, ken Asor,",
			"37": "<sup>37</sup> Ken Cedes, ken Edrii, ken En-hasor,",
			"38": "<sup>38</sup> Ken Jiron, ken Migdalel, Horem, ken Bet-anat, ken Bet-semes; sangapulo ket siam nga il-ili agraman purpurocda.",
			"39": "<sup>39</sup> Daytoy ti tawid ti caputotan dagiti annac ni Neftali a mayannurot cadagiti famfamiliada, dagiti il-ili agraman purpurocda.",
			"40": "<sup>40</sup> Ti maicapito a gasat rimmuar nga agpaay iti caputotan dagiti annac ni Dan a cas mayannurot cadagiti famfamiliada.",
			"41": "<sup>41</sup> Ket ti beddeng ti tawidda isu idi ti Sora, ken Estaol, ken Ir-semes,",
			"42": "<sup>42</sup> Ken Saalabin, ken Ayalon, ken It-la,",
			"43": "<sup>43</sup> Ken Elon, ken Timna, ken Ecron,",
			"44": "<sup>44</sup> Ken Elteque, ken Gibeton, ken Baalat,",
			"45": "<sup>45</sup> Ken Jehud, ken Bene-berac, ken Gatrimon,",
			"46": "<sup>46</sup> Ken Mejarcon, ken Racon, agraman ti beddeng nga adda iti sango ti Joppe.",
			"47": "<sup>47</sup> Ket ti beddeng dagiti annac ni Dan rimmuar iti ad-adayu pay ngem iti ayanda; ta dagiti annac ni Dan simmang-atda ket gimmubatda a maibusor iti Lesem, ket isu naalada, ken kinabilda iti tadem ti campilan, ket tinagicuada, ken nagnaedda kencuana, ket ti Lesem ninaganda iti Dan, a mayannurot iti nagan ni Dan nga amada.",
			"48": "<sup>48</sup> Daytoy ti tawid ti caputotan dagiti annac ni Dan a mayannurot cadagiti famfamiliada, dagitoy nga il-ili agraman purpurocda.",
			"49": "<sup>49</sup> Iti casta tinorpusda a biningbingay ti daga iti panagtawid a gapu iti bedbeddengna: ket dagiti annac ti Israel nangtedda iti tawid ken Josue nga anac ni Nun iti nagtetengngaanda:",
			"50": "<sup>50</sup> Mayannurot iti bilin ni Jehova intedda kencuana ti ili nga isu dinawatna, ti met laeng Timnat-sera, idiay caturodan ti Efraim; ket isu binangonna ti ili, ket nagnaed kencuana.",
			"51": "<sup>51</sup> Dagitoy isuda ngarud dagiti tawtawid, a da Eleazar a padi, ken ni Josue nga anac ni Nun, ken dagiti pangpangolo dagiti balbalay dagiti amma dagiti capcaputotan dagiti annac ti Israel, inwarasda a maipaay iti tawid a gapu iti ginasanggasat idiay Silo iti imatang ni Jehova, iti ruangan ti tolda ti gimong. Castoy ti panangturposda a panangbingay iti daga."
		},
		"20": {
			"1": "<sup>1</sup> Ket ni Jehova nagsao ken Josue, a kinunana,",
			"2": "<sup>2</sup> Agsaoca cadagiti annac ti Israel, a cunam, Mangtudingcayo cadagiti il-ili a pagcamangan, isuda nga insaoc idi cadacayo a naaramat ni Moises.",
			"3": "<sup>3</sup> Tapno ti macapapatay iti siasinoman a tao a dina napuotan ket dina ginagara agtarayto coma sadiay: ket isudanto cadacayo ti pagcamangan a gapu ken bumales iti dara.",
			"4": "<sup>4</sup> Ket daydiay agtarayto iti maysa cadagidiay nga ili, ket agtacderto iti pagsercan ti ruangan ti ili, ket ipalawagnanto ti panggepna cadagiti lapayag dagiti lallacay ti daydiay nga ili; ket isuda awatendanto cadacuada iti uneg ti ili, ket iteddanto kencuana ti maysa a disso, a pakinaedanna cadacuada.",
			"5": "<sup>5</sup> Ket no ti bumales iti dara, isu camatenna, didanto ngarud yawat ti nacapapatay iti imana; agsipud ta kinabilna ti carrubana a dina ginagara, isu a dina ginura idi unana a tiempo.",
			"6": "<sup>6</sup> Ket agnaedto idiay nga ili, inggana iti tumacderto iti pangocoman iti saclang ti gimong, inggana iti ipapatay ti nangato a padi nga addanto cadagidiay nga al-aldaw: isu ti isusublinton ti nacapapatay, ket umayto iti ilina met laeng, ken iti balayna, iti ili a nagpanawanna idi.",
			"7": "<sup>7</sup> Ket isuda dinutocanda ti Cades sadi Galilea idiay caturodan ti Neftali, ken ti Siquem idiay caturodan ti Efraim, ken ti Kiryat-arba (nga isu met la ti Hebron) idiay caturodan ti Juda.",
			"8": "<sup>8</sup> Ket iti ballasiw ti Jordan idiay Jerico nga agpadaya, tinudinganda ti Beser idiay let-ang idiay tanap nga aggapu iti caputotan ni Ruben, ken ti Ramot idiay Galaad nga aggapu iti caputotan ni Gad, ken ti Golan idiay Basan nga aggapu iti caputotan ni Manases.",
			"9": "<sup>9</sup> Dagitoy isuda dagiti il-ili a natudingan nga agpaay cadagiti isu-amin nga annac ti Israel, ken iti gangannaet a makinaed cadacuada, tapno ti uray siasino a macapapatay iti tao a dina napuotan mabalinna ti agtaray sadiay ket saan a matay iti ima ti bumales iti dara, agingga iti tumacder iti saclang ti gimong."
		},
		"21": {
			"1": "<sup>1</sup> Idin dagiti pangpangolo dagiti balbalay dagiti amma dagiti Levitas immadanida cada Eleazar a padi, ken ni Josue nga anac ni Nun, ken cadagiti pangpangolo dagiti balbalay dagiti amma dagiti capcaputotan dagiti annac ti Israel;",
			"2": "<sup>2</sup> Ket nagsaoda cadacuada idiay Silo idiay daga ti Canaan, a kinunada, Ni Jehova imbilinna iti pannacaaramat ni Moises a maited cadacami dagiti il-ili a pagtaengan, agraman cabangibangda a maipaay cadagiti an-animalmi.",
			"3": "<sup>3</sup> Ket dagiti annac ti Israel nangtedda cadagiti Levitas cadagiti cucuada, cas iti bilin ni Jehova, dagitoy nga il-ili agraman cabangibangda.",
			"4": "<sup>4</sup> Ket ti gasat rimmuar nga agpaay cadagiti famfamilia dagiti Coathitas: ket dagiti annac ni Aaron a padi a nagtaud cadagiti Levitas, adda gasatda a naggapu iti caputotan ni Juda, naggapu iti caputotan ni Simeon, ken naggapu iti caputotan ni Benjamin, a sangapulo ket tallo nga il-ili.",
			"5": "<sup>5</sup> Ket ti matda cadagiti annac ni Coat adda gasatda a naggapu cadagiti famfamilia ti caputotan ni Efraim, ken iti caputotan ni Dan, ken iti caguddua ti caputotan ni Manases, a sangapulo nga il-ili.",
			"6": "<sup>6</sup> Ket dagiti annac ni Gerson adda gasatda a naggapu iti caputotan ni Issachar ken iti caputotan ni Aser, ken iti caputotan ni Nephtali, ken iti caguddua ti caputotan ni Manases idiay Basan, a sangapulo ket tallo nga il-ili.",
			"7": "<sup>7</sup> Dagiti annac ni Merari a cas mayalubog cadagiti famfamiliada adda naggapu iti caputotan ni Ruben, ken naggapu iti caputotan ni Gad, ken naggapu iti caputotan ni Zabulon, a sangapulo ket dua nga il-ili.",
			"8": "<sup>8</sup> Ket dagiti annac ti Israel intedda a ginnasat cadagiti Levitas dagitoy nga il-ili agraman cabangibangda, cas ni Jehova imbilinna iti pannacaaramat ni Moises.",
			"9": "<sup>9</sup> Ket intedda a naggapu iti caputotan dagiti annac ni Juda, ken iti caputotan dagiti annac ni Simeon, dagitoy nga il-ili a nainaganan ditoy:",
			"10": "<sup>10</sup> Ket isuda nagpaayda cadagiti annac ni Aaron, cadagiti famfamilia ni Coat, a nagtaudda cadagiti annac ni Levi; agpaay a cucuada idi ti immuna a gasat.",
			"11": "<sup>11</sup> Ket isuda intedda cadacuada ti Kiryat arba, ni Arbe nga isu idi ti ama ni Enac (nga isu met laeng ti Hebron), idiay caturodan ti Juda, agraman cabangibangna iti aglicmut kencuana.",
			"12": "<sup>12</sup> Ngem dagiti aw-away ti ili, ken dagiti purpurocna, intedda idi ken Caleb nga anac ni Jefone a maipaay a cucuana.",
			"13": "<sup>13</sup> Ket cadagiti annac ni Aaron a padi intedda ti Hebron agraman cabangibangna nga ili a pagcamangan nga agpaay iti macapapatay, ken ti Lebna agraman cabangibangna,",
			"14": "<sup>14</sup> Ken ti Jattir agraman cabangibangna, ti Estemoa agraman cabangibangna,",
			"15": "<sup>15</sup> Ken ti Helon agraman cabangibangna, ken Debir agraman cabangibangna,",
			"16": "<sup>16</sup> Ken Ain agraman cabangibangna, ken Jutta agraman cabangibangna, ken Beth-semes agraman cabangibangna; siam nga il-ili ti naggapu cadagidiay dua a caputotan.",
			"17": "<sup>17</sup> Ket naggapu iti caputotan ni Benjamin, ti Gabaon agraman cabangibangna, ti Geba agraman cabangibangna,",
			"18": "<sup>18</sup> Ti Anatot agraman cabangibangna, ti Almon agraman cabangibangna; uppat nga il-ili.",
			"19": "<sup>19</sup> Isu-amin dagiti il-ili dagiti annac ni Aaron a dagiti papadi, sangapuloda ket tallo nga il-ili agraman cabangibangda.",
			"20": "<sup>20</sup> Ket dagiti famfamilia dagiti annac ni Coat, a Levitas, dagidiay a natda met laeng cadagiti annac ni Coat, tinagicuada dagiti il-ili ti gasatda a naggapu iti caputotan ni Efraim.",
			"21": "<sup>21</sup> Ket intedda cadacuada ti Sichem agraman cabangibangna idiay caturodan ti Efraim, nga ili a pagcamangan agpaay iti macapapatay, ken ti Geser agraman cabangibangna,",
			"22": "<sup>22</sup> Ken ti Kibsaim agraman cabangibangna, ken ti Beth-oron agraman cabangibangna; uppat nga il-ili.",
			"23": "<sup>23</sup> Ket naggapu iti caputotan ni Dan, ti Eltheco agraman cabangibangna, ti Gibethon agraman cabangibangna,",
			"24": "<sup>24</sup> Ti Ayalon agraman cabangibangna, ti Gat-rimmon agraman cabangibangna; uppat nga il-ili.",
			"25": "<sup>25</sup> Ket naggapu iti caguddua ti caputotan ni Manases, ti Taanach agraman cabangibangna, ken ti Gat-rimmon agraman cabangibangna: dua nga il-ili.",
			"26": "<sup>26</sup> Isu-amin dagiti il-ili dagiti famfamilia ti natda cadagiti annac ni Coat isuda sangapuloda agraman cabangibangda.",
			"27": "<sup>27</sup> Ket cadagiti annac ni Gerson, cadagiti famfamilia dagiti Levitas, naggapu iti caguddua ti caputotan ni Manases, intedda ti Golan idiay Basan agraman cabangibangna a ili a pagcamangan nga agpaay iti macapapatay, ken ti Borsa agraman cabangibangna; dua nga ili.",
			"28": "<sup>28</sup> Ket naggapu iti caputotan ni Issachar, ti Cesion agraman cabangibangna, ti Dabereth agraman cabangibangna,",
			"29": "<sup>29</sup> Ti Jaramuth agraman cabangibangna, ti Engannim agraman cabangibangna; uppat nga il-ili.",
			"30": "<sup>30</sup> Ket naggapu iti caputotan ni Aser ti Miseal agraman cabangibangna, ti Abdon agraman cabangibangna,",
			"31": "<sup>31</sup> Ti Helchath agraman cabangibangna, ken ti Rohob agraman cabangibangna; uppat nga il-ili.",
			"32": "<sup>32</sup> Ket naggapu iti caputotan ni Nephtali, ti Cedes idiay Galilea agraman cabangibangna, nga ili a pagcamangan nga agpaay iti macapapatay, ken ti Hammoth-dor agraman cabangibangna, ken ti Cartan agraman cabangibangna; tallo nga il-ili.",
			"33": "<sup>33</sup> Isu-amin dagiti il-ili dagiti Gersonitas cas mayalubog cadagiti famfamiliada sangapuloda ket tallo idi nga il-ili agraman cabangibangda.",
			"34": "<sup>34</sup> Ket cadagiti famfamilia dagiti annac ni Merari, a natda cadagiti Levitas, naggapu iti caputotan ni Zabulon, ti Jocneam agraman cabangibangna, ken Cartha agraman cabangibangna,",
			"35": "<sup>35</sup> Ti Dimna agraman cabangibangna, Naalal agraman cabangibangna; uppat nga il-ili.",
			"36": "<sup>36</sup> Ket naggapu iti caputotan ni Ruben, ti Beser agraman cabangibangna, ken Jasa agraman cabangibangna,",
			"37": "<sup>37</sup> Ti Cedemot agraman cabangibangna, ken Mefaat agraman cabangibangna; uppat nga il-ili.",
			"38": "<sup>38</sup> Ket naggapu iti caputotan ni Gad, ti Ramot idiay Galaad agraman cabangibangna, iti ili a pagcamangan nga agpaay iti macapapatay, ken ti Mahanaim agraman cabangibangna,",
			"39": "<sup>39</sup> Ti Hesbon agraman cabangibangna, ken Jacer agraman cabangibangna: uppat nga il-ili ti dagupda.",
			"40": "<sup>40</sup> Amin dagitoy isuda idi dagiti il-ili dagiti annac ni Merari a cas mayannurot cadagiti famfamiliada, a natda met laeng cadagiti famfamilia dagiti Levitas; ket ti gasatda ti sangapulo ket dua nga il-ili.",
			"41": "<sup>41</sup> Amin dagiti il-ili dagiti Levitas iti nagtengngaan dagiti cucua dagiti annac ti Israel uppat a puloda ket walo nga il-ili agraman cabangibangda.",
			"42": "<sup>42</sup> Dagitoy nga il-ili naaddaan ti tunggal maysa cadagiti cabangibangna nga aglicmut cadacuada: castoy idi cadagitoy amin nga il-ili.",
			"43": "<sup>43</sup> Iti casta ni Jehova intedna iti Israel ti isu-amin a daga nga insapatana idi nga itdenna cadagiti ammada; ket isu tinagicuada, ket nagnaedda kencuana.",
			"44": "<sup>44</sup> Ket ni Jehova intedna idi ti talna cadacuada iti aglicmut, a mayalubog iti isu-amin nga insapatana idi cadagiti ammada: ket awan cadagiti isu-amin a cabusorda ti nagtacder iti sangoananda, ni Jehova inyawatna cadagiti im-imada dagiti isu-amin a cabusorda.",
			"45": "<sup>45</sup> Awan a pulos idi ti nagcurang ti uray ania a naimbag nga insao ni Jehova iti balay ti Israel; isu-amin natungpal idi."
		},
		"22": {
			"1": "<sup>1</sup> Idin ni Josue inayabanna dagiti Rubenitas, ken dagiti Gaditas, ken iti caguddua ti caputotan ni Manases,",
			"2": "<sup>2</sup> Ket kinunana cadacuada, Dacayo inaywananyo amin daydiay a ni Moises nga adipen ni Jehova imbilinna idi cadacayo, ket nagtungpalcayo iti timecco iti isu-amin nga imbilinco cadacayo:",
			"3": "<sup>3</sup> Saanyo idi a binaybay-an dagiti cacabsatyo cadagitoy adu nga al-aldaw agingga ita nga aldaw, no di ket inaywananyo idi ti incumit ti bilin ni Jehova a Diosyo.",
			"4": "<sup>4</sup> Ket ita yantangay ni Jehova a Diosyo intedna ti inana cadagiti cacabsatyo, a cas insaona idi cadacuada: gapuna nga ita agsublicayo, ket incayon cadagiti toltoldayo, iti daga a pagtagicuaanyo, isu a ni Moises nga adipen ni Jehova intedna idi cadacayo iti ballasiw ti Jordan.",
			"5": "<sup>5</sup> Isuna laeng nga iti kinaregta salimetmetanyo coma nga tungpalen ti bilin ken linteg a ni Moises nga adipen ni Jehova imbilinna idi cadacayo nga ayatenyo coma ni Jehova a Diosyo, ket magnacayo coma cadagiti isu-amin a daldalanna, ken aywananyo coma dagiti bilbilinna, ken cumpetcayo coma kencuana, ken isu ti pagservianyo coma iti amin a pusoyo ken iti amin a cararuayo.",
			"6": "<sup>6</sup> Iti casta ni Josue binendicionanna ida ket pinalubosanna ida; ket napanda cadagiti toltoldada.",
			"7": "<sup>7</sup> Iti caguddua ti caputotan ni Manases ni Moises intedna a tawid ti Basan; ngem iti sabali a caguddua ni Josue intedna iti nagtengngaan dagiti cacabsatda iti ballasiw ti Jordan nga agpalaud. Casta met nga idi a ni Josue imbaonna ida cadagiti toltoldada, binendicionanna ida,",
			"8": "<sup>8</sup> Ket nagsao idi cadacuada, a cunana, Agsublicayon cadagiti toltoldayo agraman nawadwad a sanicua, ken agraman dackel nga arban ti an-animal, agraman pirac, ken agraman balitoc, ken agraman suer, ken agraman landoc, ken agraman adu a cawcawes: bingayenyo cadagiti cacabsatyo ti nasamsam cadagiti cabcabusoryo.",
			"9": "<sup>9</sup> Ket dagiti annac ni Ruben ken dagiti annac ni Gad ken ti caguddua ti caputotan ni Manases nagsublida idi, ket pimmanawda cadagiti annac ti Israel idiay Silo, nga adda idiay daga ti Canaan, tapno mapanda iti daga ti Galaad, iti daga a cucuada, isu nga tinagicuada idi, a mayannurot iti bilin ni Jehova a naaramat ni Moises.",
			"10": "<sup>10</sup> Ket idi a nacagtengda iti arubayan ti Jordan, nga adda idiay daga ti Canaan, dagiti annac ni Ruben dagiti annac ni Gad ken ti caguddua ti caputotan ni Manases nangbangonda idiay ti maysa nga altar iti denna ti Jordan, maysa nga altar a dackel ti buyana.",
			"11": "<sup>11</sup> Ket dagiti annac ti Israel nangngegda idi a naisao, Adtoy, a dagiti annac ni Ruben ken dagiti annac ni Gad ken ti caguddua ti caputotan ni Manases nangbangonda iti maysa nga altar iti sango ti daga ti Canaan, idiay arubayan ti Jordan, iti abay a cucua dagiti annac ti Israel.",
			"12": "<sup>12</sup> Ket idi a dagiti annac ti Israel nangngegda, amin a gimong dagiti annac ti Israel naguornongda idiay Silo, tapno sumang-atda a makigubat a maibusor cadacuada.",
			"13": "<sup>13</sup> Ket dagiti annac ti Israel imbaonda cadagiti annac ni Ruben, ken cadagiti annac ni Gad, ken iti caguddua ti caputotan ni Manases, idiay daga ti Galaad, ni Fenees nga anac a lalaki ni Eleazar a padi,",
			"14": "<sup>14</sup> Ken sangapulo a pangpangoloen kencuana, maysa a pangoloen iti tunggal balay ti ama ti isu-amin a caputotan ti Israel; tunggal maysa cadagidiay isu idi ti pangolo ti balay dagiti ammada iti tengnga ti rinibribu ti Israel.",
			"15": "<sup>15</sup> Ket immayda cadagiti annac ni Ruben, ken cadagiti annac ni Gad, ken iti caguddua ti caputotan ni Manases, iti daga ti Galaad, ket nakisaoda idi cadacuada, a kinunada,",
			"16": "<sup>16</sup> Castoy ti cuna ti isu-amin a gimong ni Jehova, Ania a panaglabsing daytoy a panangbusoryo iti Dios ti Israel, nga suminacayo ita nga aldaw manipud iti isusurotyo ken Jehova, iti daydiay panangbangonyo iti maysa nga altar, tapno ita nga aldaw sumungitcayo a maibusor ken Jehova?",
			"17": "<sup>17</sup> Bassit aya unay cadatayo daydi kinadakes ni Peor, isu nga ditayo pay laeng nagugoran agingga ita nga aldaw, nupay immay ti didigra iti gimong ni Jehova,",
			"18": "<sup>18</sup> Ta dacayo suminacayo ita nga aldaw manipud iti isusurotyo ken Jehova? ket isunto, nga idinto a makita a dacayo sumungitcayo ita nga aldaw a maibusor ken Jehova, nga intono bigat agpungtotto cadagiti isu-amin a gimong ti Israel.",
			"19": "<sup>19</sup> Ngem no ti daga tagicuaenyo isu ti narugit, umallatiwcayo ngarud iti daga a pagtagicuaan ni Jehova, isu a pagtaengan ti tabernaculo ni Jehova, ket mangalacayo iti cucua iti tengngami: ngem dicayo sumungit coma a maibusor ken Jehova, dicayo met sumungit a bumosor cadacami, iti panangbangonyo iti maysa nga altar iti lacsid ti altar ni Jehova a Diostayo.",
			"20": "<sup>20</sup> Saan aya a nacaaramid ni Achan nga anac a lalaki ni Zera iti panaglabsing iti naipaay a banag, ket immay ti pungtot iti isu-amin a gimong ti Israel? ket daydi a lalaki saan a napucaw a maymaysa idi kinadakesna.",
			"21": "<sup>21</sup> Idin dagiti annac ni Ruben ken dagiti annac ni Gad ken ti caguddua ti caputotan ni Manases simmungbatda, ket nagsaoda cadagiti pangpangoloen ti rinibribu ti Israel,",
			"22": "<sup>22</sup> Ti Maymaysa a Maingel, ti Dios, a ni Jehova, ti Maymaysa a Maingel, ti Dios, a ni Jehova, isu ammona; ket ti Israel ammoenna coma; no isu isusungit, wenno isu panaglabsing a maicaniwas ken Jehova (sica dinacami coma ispalen ita nga aldaw),",
			"23": "<sup>23</sup> Nga nangbangoncami cadacami iti maysa nga altar tapno suminacami manipud iti isusurot ken Jehova; wenno no agidatoncami kencuana ti daton a mapuuran wenno daton a macan wenno no agidatoncami iti rabawna cadagiti datdaton ti cappia, ni met laeng Jehova sapulenna coma cadacami:",
			"24": "<sup>24</sup> Ket dicami inaramid daytoy no di ket gapu iti kinaaluad, ken iti panggep, a kinunami, Iti tiempo nga umay dagiti annacyo saoendanto ngata cadagiti annacmi, a cunada, Ania ti bibiangyo ken Jehova a Dios ti Israel?",
			"25": "<sup>25</sup> Ta ni Jehova inaramidna ti Jordan a maysa a pagbeddengan iti nagbaetantayo, dacayo annac ni Ruben, ken annac ni Gad; dacayo awan ti biangyo ken Jehova: iti casta dagiti annacyo aramidendanto dagiti annacmi a sumardengda iti panagbutengda ken Jehova.",
			"26": "<sup>26</sup> Gapu itoy kinunami, Agsaganatayo coma ita a mangbangon cadatayo iti maysa nga altar, saan nga agpaay ti daton a mapuuran, saan met nga agpaay iti sacrificio:",
			"27": "<sup>27</sup> No di ket isu coma ti maysa a pamanecnec cadacami ken cadacayo, ken cadagiti putottayo iti calpasantayo, tapno aramidentayo coma ti panagservi ken Jehova iti saclangna cadagiti datdatontayo a mapuuran, ken cadagiti sacrificiotayo, ken datdatontayo ti cappia; tapno dagiti annacyo didanto coma cunaen iti tiempo a mapasungad cadagiti annacmi, Dacayo awan ti biangyo ken Jehova.",
			"28": "<sup>28</sup> Dacami ngarud kinunami, Isunto, nga intono cunaenda coma cadacami wenno cadagiti putputotmi iti mapasungad a tiempo, a datayo cunaentayto. Adtoy ti ladawan ti altar ni Jehova, isu nga inaramid idi dagidi ammami, saan nga agpaay iti daton a mapuuran, wenno iti sacrificio; no di ket isu ti pamanecnec cadacami ken cadacayo.",
			"29": "<sup>29</sup> Mayadayu coma cadacami a sumungitcami a bumosor ken Jehova, ken suminacami itoy nga aldaw manipud iti isusurot ken Jehova, iti panangbangon ti altar nga agpaay iti daton a mapuuran, agpaay iti daton a macan, wenno agpaay iti sacrificio, iti lacsid ti altar ni Jehova a Diostayo nga adda iti sango ti tabernaculona.",
			"30": "<sup>30</sup> Ket idi a ni Finees a padi, ken dagiti pangoloen ti gimong, a dagiti met laeng pangpangolo ti rinibribu ti Israel a maicuyog kencuana, mangegda dagiti sasao a dagiti annac ni Ruben, ken dagiti annac ni Gad, ken dagiti annac ni Manases insaoda, naparagsacanda a naimbag.",
			"31": "<sup>31</sup> Ket ni Finees nga anac ni Eleazar a padi kinunana cadagiti annac ni Ruben, cadagiti annac ni Gad, ken cadagiti annac ni Manases, Ita nga aldaw maammoanmi ni Jehova adda iti nagtengngaantayo, agsipud ta dicayo inaramid daytoy a panglabsing a maicaniwas ken Jehova: itatta inyanawayo dagiti annac ti Israel iti ima ni Jehova.",
			"32": "<sup>32</sup> Ket da Finees nga anac ni Eleazar a padi, ken dagiti pangpangoloen nagawidda manipud cadagiti annac ni Ruben, ken cadagiti annac ni Gad, a naggapuda iti daga ti Galaad, agtungpal iti daga ti Canaan, cadagiti annac ti Israel, ket inyegda manen ti sao.",
			"33": "<sup>33</sup> Ket ti panggep pinaragsacna dagiti annac ti Israel; ket dagiti annac ti Israel binenditoda ti Dios, ket uray caano dida nagsaon iti isasang-atda a maibusor cadacuada iti pananggubat, a mangduprac iti daga a pagyanan idi dagiti annac ni Ruben, ken dagiti annac ni Gad.",
			"34": "<sup>34</sup> Ket dagiti annac ni Ruben ken dagiti annac ni Gad ninaganda daydi altar iti   Ed: Ta, isuda kinunada, isu ti pamanecnec cadatayo a ni Jehova isu ti Dios."
		},
		"23": {
			"1": "<sup>1</sup> Ket naaramid idi calpasan dagiti adu nga al-aldaw, idi a ni Jehova intedna ti inana iti Israel iti isu-amin a cabcabusorna iti aglicmut, ket ni Josue lacayen ken napacapuy cadagiti tawtawen;",
			"2": "<sup>2</sup> A ni Josue inayabanna amin nga Israel, dagiti lallacay ken dagiti pangpangoloenda, ken dagiti oc-ocomda ken amin dagiti agturturayda, ket kinunana cadacuada, Siac lacayacon, napacapuyac cadagiti tawtawen:",
			"3": "<sup>3</sup> Ket dacayo nakitayo idi amin daydi a ni Jehova a Diosyo inaramidna cadagitoy a pagpagarian gapu cadacayo; ta ni Jehova a Diosyo nakibacal idi a gapu cadacayo.",
			"4": "<sup>4</sup> Adtoy, siac biningbingayco cadacayo dagitoy a pagpagarian a matda, tapno isu ti tawid nga agpaay cadagiti capcaputotanyo, manipud iti Jordan, agraman cadagiti isu-amin a pagpagarian a dinupracco, agingga met laeng iti dackel a taaw nga agturong iti lelennecan ti init.",
			"5": "<sup>5</sup> Ket ni Jehova a Diosyo pagtalaoennanto ida iti sangoananyo, ket idoronnanto ida manipud iti imatangyo; ket dacayo tagicuaenyonto dagiti dagdagada, cas sinao idi ni Jehova cadacayo.",
			"6": "<sup>6</sup> Gapuna nga umingelcayo unay a mangaywan ken mangaramid iti amin nga adda a naisurat iti libro ti linteg ni Moises, a dicayo sumiasi kencuana uray iti macanawan wenno iti macatigid;",
			"7": "<sup>7</sup> A dicay umasideg cadagitoy a nasnacion, dagitoy a natda cadacayo; dicayo coma sarsaritaen ti nagan dagiti didiosda, dicayo coma agpasapata a gapu cadacuada, dicayo coma pagservian ida, dicayo coma agrucnoy cadacuada;",
			"8": "<sup>8</sup> No di ket cumpetcayo ken Jehova a Diosyo, a cas inaramidyo agingga ita nga aldaw.",
			"9": "<sup>9</sup> Ta ni Jehova pinagtalaona idi iti saclangyo dagiti dadackel ken napigsa a pagpagarian: ta cas la cadacayo awan ti tao nga agtacder iti sangoyo agingga ita nga aldaw.",
			"10": "<sup>10</sup> Maysa a lalaki cadacayo, camatennanto ti sangaribu; ta ni Jehova a Diosyo, isu ti makibacal a gapu cadacayo, a cas isu sinaona idi cadacayo.",
			"11": "<sup>11</sup> Gapuna a kitaenyonto a nalaing ti maipapan cadacayo met laeng, tapno ay-ayatenyo coma ni Jehova a Diosyo.",
			"12": "<sup>12</sup> Ta no tumalicudcayto iti uray apagbassit, ket cumpetcayo iti natda cadagitoy a pagpagarian, uray cadagitoy a natda iti nagtengngaanyo, ken no mangasawacayo cadacuada, ket sumreccayo cadacuada, ket isuda cadacayo;",
			"13": "<sup>13</sup> Ammoenyo a pudno unay a ni Jehova a Diosyo uray caano dinanto pagtalaoenen dagitoy a pagpagarian iti sangoananyo; no di ket isudanto ti silo ken pacaitibcolan cadacayo ken pagbaut nga agpaay cadagita bacrangyo, ken sisiit nga agpaay cadagita matayo, agingga iti mapucawcayo iti daytoy nasayaat a daga a ni Jehova a Diosyo intedna cadacayo.",
			"14": "<sup>14</sup> Ket, adtoy, ita nga aldaw magmagnaacon iti dalan ti isu-amin a daga: ket ammoenyo iti amin a pusoyo ken amin a cararuayo, nga awan ti uray maysa a nagcurang cadagiti amin a naimbag a ni Jehova a Diosyo insaona a maipanggep cadacayo; isuda amin natungpalda cadacayo, awan ti nagcurang cadacuada nga uray maysa.",
			"15": "<sup>15</sup> Ket maaramidto a cas iyaayna cadacayo ti isu-amin a banbanag a naimbag a ni Jehova a Diosyo sinaona idi cadacayo, casta met ti panangyegto ni Jehova cadacayo ti isu-amin a banbanag a dakes, inggana iti madadaelnacayo iti rabaw ti daga a nasayaat a ni Jehova a Diosyo intedna cadacayo.",
			"16": "<sup>16</sup> Intono aglabsingcayo iti tulag ni Jehova a Diosyo, nga imbilinna idi cadacayo, ket incayto ken agservicayto cadagiti didios a sabsabali, ket agrucnoycayto cadacuada; isu ti iseseggedton ti pungtot ni Jehova a maibusor cadacayo, ket mapucawcayto a madaras unay iti daytoy nasayaat a daga nga isu intedna idi cadacayo."
		},
		"24": {
			"1": "<sup>1</sup> Ket ni Josue inummongna amin dagiti capcaputotan ti Israel idiay Siquem ket inayabanna dagiti lallacay ti Israel, ken dagiti pangpangoloenda, ken dagiti oc-ocomda, ken dagiti agturturayda; ket nagparangda iti saclang ti Dios.",
			"2": "<sup>2</sup> Ket ni Josue kinunana iti amin nga ili, Castoy ti cuna ni Jehova, a Dios ti Israel, Dagidi ammayo nagnaedda idi ugma iti ballasiw ti Carayan, ni met laeng Tare nga ama ni Abraham, ken ama ni Nacor: ket nagservida idi cadagiti sabsabali a didios.",
			"3": "<sup>3</sup> Ket siac innalac idi ni amayo nga Abraham nanipud iti ballasiw ti Carayan, ket isu inyegco idi iti amin a daga ti Canaan, ket pinaaduc idi dagiti putputotna, ket intedco kencuana ni Isaac.",
			"4": "<sup>4</sup> Ket intedco ken Isaac da Jacob, ken ni Esau: ket intedco ken Esau ti bantay Seir, tapno tagicuaenna; ket ni Jacob ken dagiti annacna simmalogda idi sadi Egipto.",
			"5": "<sup>5</sup> Ket imbaonco ni Moises, ken ni Aaron, ket dinidigrac idi ti Egipto, cas mayannurot iti daydi nga inaramidco iti tengngana: ket iti calpasanna inaoncayo.",
			"6": "<sup>6</sup> Ket inaonco dagiti ammayo sadi Egipto: ket immaycayo iti baybay; ket dagiti taga Egipto kinamatda dagiti ammayo agingga iti Baybay a Nalabaga agraman luglugan ken nagsasacay cadagiti cabcabayo.",
			"7": "<sup>7</sup> Ket idi nga immasugda ken Jehova, isu incabilna ti maysa a sipnget iti nagbaetan dacayo ken cadagiti taga Egipto, ket inyegna iti rabawda ti baybay isu a nanglapunos cadacuada; ket dagiti matayo nakitada daydi nga inaramidco sadi Egipto: ket nagyancayo idi iti adu nga al-aldaw idiay let-ang.",
			"8": "<sup>8</sup> Ket inserreccayo iti daga dagiti Amorreos, a nagnaed ballasiw ti Jordan: ket isuda nakibacalda cadacayo; ket inyawatco ida iti imayo; ket tinagicuayo ti dagada; ket dinadaelco ida manipud iti sangoananyo.",
			"9": "<sup>9</sup> Idin ni Balac nga anac a lalaki ni Sefor, nga ari dagiti Moabitas timmacder ket nakibacal idi iti Israel: ket nagbaon ket inayabanna ni Balaam nga anac a lalaki ni Beor, tapno ilunodnacayo coma idi;",
			"10": "<sup>10</sup> Ngem siac diac kinayat a dinengngeg ni Balaam; ngarud binendicionannacayo pay ketdi: iti casta inispalcayo iti imana.",
			"11": "<sup>11</sup> Ket dacayo bimmallasiwcayo iti Jordan, ket immaycayo iti Jerico: ket dagiti tattao a taga Jerico nakibacalda idi cadacayo, dagiti Amorreos, ken dagiti Perezeos, ken Cananeos, ken Heteos, ken Gergeseos, dagiti Heveos, ken Jebuseos; ket siac inyawatco ida ita imayo.",
			"12": "<sup>12</sup> Ket imbaonco idi dagiti alimboboyog iti sangoananyo, a nangpatalao cadacuada manipud iti sangoananyo, cadagiti met laeng dua nga ar-ari dagiti Amorreos; saan nga iti campilanmo, saan a iti ba-im.",
			"13": "<sup>13</sup> Ket intedco cadacayo ti daga isu a dica nagbanbannogan, ken dagiti il-ili, a dicayo binangon, ket agnaedcayo kencuana; ken dagiti cauv-uvasan ken caol-olivaan a dicayo minulaan, isuda a pagcaananyo.",
			"14": "<sup>14</sup> Ita ngarud agbutengcayo ken Jehova, ket agservicayo kencuana iti kinadalus ken kinapudno; ket iccatenyo dagiti didios isuda a dagidi ammayo nagservianda iti ballasiw ti Carayan, ken sadi Egipto; ket agservicayo ken Jehova.",
			"15": "<sup>15</sup> Ket no dakes ti panangipagarupyo iti panagservi ken Jehova, agpilicayo ita nga aldaw no siasino ti pagservianyonto: no ketdi dagiti didios a nagservian idi dagiti ammayo idi addada dita ballasiw ti Carayan, wenno cadagiti didios dagiti Amorreos, a ti dagada pagtaenganyo: ngem siac ken ti balayco agservicamto ken Jehova.",
			"16": "<sup>16</sup> Ket ti ili simmungbat, ket kinunana, Adayu cadacami nga idianmi coma ni Jehova, tapno agservicami cadagiti sabsabali a didios;",
			"17": "<sup>17</sup> Ta ni Jehova a Diostayo, isu ti nangaon cadatayo ken cadagiti ammatayo nanipud daga ti Egipto, nanipud iti balay ti pannacaadipen, isu nga iti imatangmi nangaramid cadagiti dadackel a pagilasinan, ken nangsalacnib cadacami iti amin a dalan isu a nagnaanmi; ken cadagiti il-ili isuda a linasatmi;",
			"18": "<sup>18</sup> Ket ni Jehova pinagtalaona idi iti sangoananmi dagiti isu-amin nga il-ili, iti met laeng Amorreo nga agnaed idi iti daga: gapuna a dacami met agservicamto ken Jehova: ta isu ti Diostayo.",
			"19": "<sup>19</sup> Ket ni Josue kinunana iti ili, Dicayo mabalin ti agservi ken Jehova: ta isu ti Dios a nasantoan, isu ti Dios a naimun; dinanto pacawanen dagiti panaglabsingyo uray dagiti basbasolyo.",
			"20": "<sup>20</sup> No idianyo ni Jehova, ket agservicayonto cadagiti sabsabali a didios, isu ti panagbaw-ingnanton ket agaramidto cadacayo iti dakes, ket runawennacayto iti calpasan daydi panagaramidna iti imbag cadacayo.",
			"21": "<sup>21</sup> Ket ti ili kinunana ken Josue, Saan; no di ket agservicaminto ken Jehova.",
			"22": "<sup>22</sup> Ket ni Josue kinunana iti ili, Dacayo dagiti macasacsi a maibusor cadacayo met laeng a dacayo piniliyo cadacayo ni Jehova, nga isu ti pagservianyo. Ket isuda kinunada, Dacami dagiti macasacsi.",
			"23": "<sup>23</sup> Iccatenyo ngarud ita, isu kinunana, dagiti sabsabali a didios nga addada iti tengngayo ket irucnoyyo ta pusoyo ken Jehova a Dios ti Israel.",
			"24": "<sup>24</sup> Ket ti ili kinunana ken Josue, Agservicaminto ken Jehova a Diosmi; ken ipangagminto ti timecna.",
			"25": "<sup>25</sup> Iti casta ni Josue nagaramid ti tulag iti ili iti daydi nga aldaw, ket nangicabil cadacuada cadagiti al-alagaden ken linlinteg idiay Siquem.",
			"26": "<sup>26</sup> Ket ni Josue insuratna dagitoy a sasao iti libro ti linteg ti Dios: ket nangala iti maysa a dackel a bato ket isu impatacderna iti siroc ti maysa a cayo a lugo nga adda idi iti denna ti santuario ni Jehova.",
			"27": "<sup>27</sup> Ket ni Josue kinunana iti amin nga ili, Adtoy, daytoy a bato isunto macasacsi a maibusor cadatayo; ta nangngegna amin dagiti sasao ni Jehova nga insaona idi cadatayo: gapuna a isunto ti macasacsi a maibusor cadacayo, di la ket ta ilibacyo ti Diosyo.",
			"28": "<sup>28</sup> Iti casta ni Josue imbaonna ti umili, tunggal maysa a tao iti tawidna.",
			"29": "<sup>29</sup> Ket naaramid iti calpasan dagitoy a banag, a ni Josue nga anac ni Nun nga adipen ni Jehova, natay, idinto nga agtawen iti sangagasut ket sangapulo a tawen.",
			"30": "<sup>30</sup> Ket isu imponponda idiay sacup ti cucuana idiay Timnat-sera, nga adda idiay caturodan ti Efraim iti amianan ti bantay Gaas.",
			"31": "<sup>31</sup> Ket ti Israel nagservi idi ken Jehova iti isu-amin nga al-aldaw ni Josue, ken amin nga al-aldaw dagiti lallacay a nagbiag idi calpasan ni Josue, ken nacaammo cadagiti isu-amin nga aramid ni Jehova, nga inaramidna idi nga agpaay iti Israel.",
			"32": "<sup>32</sup> Ket dagiti tultulang ni Jose, isuda a dagiti annac ti Israel innalada a ingapu sadi Egipto, imponponda idiay Siquem idiay paset ti daga a ni Jacob ginatangna idi cadagiti annac ni Hemor nga ama ni Siquem iti sangagasut a capisi a pirac: ket isuda nagbalinda a tawid cadagiti annac ni Jose.",
			"33": "<sup>33</sup> Ket ni Eleazar nga anac ni Aaron natay; ket isu imponponda idiay turod ni Finees nga anacna, isu a naited idi kencuana idiay caturodan ti Efraim."
		}
	}
};
module.exports = book;